	VALUES (0, 'Jonathan_Joestar', 'Jonathan_Joestar@jojo.com', '$2b$12$iSRy/9WXNSYse04qYj8ZKOtkcpF4n6AYAruGRM7kOimq4NaFbIvra', 'Jonathan Joestar', 'Jonathan Joestar (ジョナサン・ジョースター, Jonasan Jōsutā) is the main protagonist of the first part of the JoJo''s Bizarre Adventure series, Phantom Blood, and the first JoJo of the series. His legacy extends throughout almost the entirety of the first six parts of the series, with major characters such as Joseph Joestar and Jotaro Kujo being his descendants.', TIMESTAMP WITH TIME ZONE '2018-11-09 07:38:13+00', 2971, TRUE);
	VALUES (1, 'Will_Anthonio_Zeppeli', 'Will_Anthonio_Zeppeli@jojo.com', '$2b$12$lXUdWEb8GVs1slSPqwb74ejkxxKLMWKI5mlbzQ51aYnKH/b30264e', 'Will Anthonio Zeppeli', 'Will Anthonio Zeppeli (ウィル・Ａ(アントニオ)・ツェペリ, Wiru Antonio Tseperi), also known as Baron Zeppeli (ツェペリ男爵, Tseperi Danshaku), is a primary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood.', TIMESTAMP WITH TIME ZONE '2018-04-09 08:36:17+00', 7829, TRUE);
	VALUES (2, 'Robert_E._O._Speedwagon', 'Robert_E._O._Speedwagon@jojo.com', '$2b$12$kIv/zjDJLcN1tKaVbNHMYuOslg9gZ4cbG2yliEYl4E6U8kM550Ihe', 'Robert E. O. Speedwagon', 'Robert E. O. Speedwagon (ロバート・E・O・スピードワゴン, Robāto Ī Ō Supīdowagon) is a primary ally featured in the 1st part of the JoJo''s Bizarre Adventure series, Phantom Blood. Formerly a Londoner thug residing in Ogre Street, Speedwagon befriends Jonathan Joestar and becomes a loyal ally to his cause.', TIMESTAMP WITH TIME ZONE '2018-04-19 15:14:29+00', 8380, FALSE);
	VALUES (3, 'Erina_Pendleton', 'Erina_Pendleton@jojo.com', '$2b$12$H2BsiCIEykxHFdvjoKVZqeVRqf6gcMSIzltBreGGSSb8PPFZM4LU2', 'Erina Pendleton', 'Erina Pendleton (エリナ・ペンドルトン, Erina Pendoruton) is a secondary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood, as well as the second part, Battle Tendency.', TIMESTAMP WITH TIME ZONE '2020-04-14 10:57:47+00', 8500, TRUE);
	VALUES (4, 'Poco', 'Poco@jojo.com', '$2b$12$IDmPTguZW0FK60C0RwEA8.CaXVdWqv3ZFYIy4i9h4B4NDSUMc.h0i', 'Poco', 'Poco (ポコ,, Poko) is a secondary ally featured in the first part of the JoJo''s Bizarre Adventure series,  Phantom Blood.', TIMESTAMP WITH TIME ZONE '2020-01-03 17:15:56+00', 3284, TRUE);
	VALUES (5, 'George_Joestar_I', 'George_Joestar_I@jojo.com', '$2b$12$I367tbry86y4V9pdXBTp8uJep7kHQDL75ra57Bm5FGNRn9YoneWV.', 'George Joestar I', 'George Joestar I (ジョージ・ジョースターⅠ世, Jōji Jōsutā Issei) is a secondary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood.', TIMESTAMP WITH TIME ZONE '2018-12-10 00:10:20+00', 9852, TRUE);
	VALUES (6, 'Tonpetty', 'Tonpetty@jojo.com', '$2b$12$Va2PZ7SdRhoPFhQLHO2b5.pILeDJYC/NfVuiV7DzVwXw/HkOdMyY.', 'Tonpetty', 'Tonpetty (トンペティ, Tonpeti) is a tertiary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood. He is a Ripple master who trained Will Anthonio Zeppeli, later joining forces with Jonathan directly alongside his disciples Straizo and Dire.', TIMESTAMP WITH TIME ZONE '2018-03-04 22:30:07+00', 1559, TRUE);
	VALUES (7, 'Straizo', 'Straizo@jojo.com', '$2b$12$uozrEwlkEkNR4jSFHqgolORIO8S9VR9tyO0t/zYIfCTwj6QWFkrfq', 'Straizo', 'Straizo (ストレイツォ, Sutoreitso) is tertiary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood, and a secondary antagonist in the second part, Battle Tendency. ', TIMESTAMP WITH TIME ZONE '2019-12-05 20:31:44+00', 3373, TRUE);
	VALUES (8, 'Dire', 'Dire@jojo.com', '$2b$12$K.jKmO6uk1g9syzJM0Rke.PuHvlGpvmOj3jMoTv9BnORPj/aw98t6', 'Dire', 'Dire (ダイアー, Daiā) is a tertiary ally featured in the first part of the JoJo''s Bizarre Adventure series, Phantom Blood. ', TIMESTAMP WITH TIME ZONE '2020-05-30 02:11:21+00', 8591, TRUE);
	VALUES (9, 'Dio_Brando', 'Dio_Brando@jojo.com', '$2b$12$J/U/MmA7sksr9M2gCMJNWu0A6cOAH.ypP1PcwKkH9Xlq.TUR1TH1.', 'Dio Brando', 'Dio Brando (ディオ・ブランドー, Dio Burandō), later known simply as DIO (ＤＩＯ(ディオ)), is the main antagonist of the first and third parts of the JoJo''s Bizarre Adventure series, Phantom Blood and Stardust Crusaders, as well as a posthumous primary antagonist in the sixth part, Stone Ocean. His influence is felt throughout all of the first six parts of the series, with major characters such as Giorno Giovanna and Enrico Pucci being directly connected to him.', TIMESTAMP WITH TIME ZONE '2018-12-15 17:14:47+00', 9327, TRUE);
