Joseph Joestar (ジョセフ・ジョースター, Josefu Jōsutā) is the main protagonist of the second part of the JoJo''s Bizarre Adventure series, Battle Tendency, and the second JoJo of the series. He also appears as a primary ally in Stardust Crusaders, and a secondary ally in Diamond is Unbreakable.', TIMESTAMP WITH TIME ZONE '2018-03-27 20:35:54+00', 9484, TRUE);
	VALUES (53, 'Caesar_Anthonio_Zeppeli', 'Caesar_Anthonio_Zeppeli@jojo.com', '$2b$12$XrGuI311Z8C3aWFfTKVG4eXjC4vWuojP0ZR3rznhausKy.DREL4T6', 'Caesar Anthonio Zeppeli', 'Caesar Anthonio Zeppeli (シーザー・アントニオ・ツェペリ, Shīzā Antonio Tseperi) is a primary ally featured in the second part of the JoJo''s Bizarre Adventure series, Battle Tendency.', TIMESTAMP WITH TIME ZONE '2018-11-20 17:30:49+00', 844, TRUE);
	VALUES (54, 'Lisa_Lisa', 'Lisa_Lisa@jojo.com', '$2b$12$CUn5bJwDe9urFcus22Ul2.z9nYjxD45Ukhcay3ihCX/94uCxiL1nC', 'Lisa Lisa', 'Lisa Lisa (リサリサ, Risa Risa), full name Elizabeth Joestar (エリザベス・ジョースター, Erizabesu Jōsutā), is a primary ally featured in the second part of the JoJo''s Bizarre Adventure series, Battle Tendency, but introduced in the first part, Phantom Blood.', TIMESTAMP WITH TIME ZONE '2018-06-11 06:14:37+00', 2309, TRUE);
	VALUES (55, 'Rudol_von_Stroheim', 'Rudol_von_Stroheim@jojo.com', '$2b$12$vhfbxglOTfzQBzVf5LWamOAbCcxr8.To2veMTxXyg7iOvGPKY88Ui', 'Rudol von Stroheim', 'Rudol von Stroheim (ルドル・フォン・シュトロハイム, Rudoru fon Shutorohaimu) is a primary ally featured in the 2nd part of JoJo''s Bizarre Adventure, Battle Tendency.', TIMESTAMP WITH TIME ZONE '2018-03-15 02:05:25+00', 9969, TRUE);
