	VALUES (57, 'Loggins', 'Loggins@jojo.com', '$2b$12$azFlBIiakNias7A1Kjs9F.KaIbAFf6SSbNvdVC6rpNsSgpGWTumce', 'Loggins', 'Loggins (ロギンズ, Roginzu) is a minor ally featured in the second part of the JoJo''s Bizarre Adventure series, Battle Tendency. As one of Lisa Lisa''s servants and a fellow Ripple master, he personally trains Joseph after his first encounter with the Pillar Men.', TIMESTAMP WITH TIME ZONE '2018-03-09 16:38:28+00', 4220, TRUE);
	VALUES (58, 'Smokey_Brown', 'Smokey_Brown@jojo.com', '$2b$12$5UWfc3yahKpC8cz9Pp5NOuLFyAQptel6EnGhSSVlQgwc/GsG//Nh6', 'Smokey Brown', 'Smokey Brown (スモーキー・ブラウン Sumōkī Buraun) is a minor ally featured in the 2nd part of JoJo''s Bizarre Adventure, Battle Tendency. ', TIMESTAMP WITH TIME ZONE '2020-08-12 15:10:19+00', 3123, TRUE);
	VALUES (59, 'Suzi_Q', 'Suzi_Q@jojo.com', '$2b$12$fh4aIVI.1mCPL2IZmJyR3.n3p5NPZg8bvJ2ZNxXZWpYG8h1TKlom.', 'Suzi Q', 'Suzi Q (スージーQ, Sūjīkyū), later known as Suzi Q Joestar (スージーQ・ジョースター, Sūjīkyū Jōsutā), is a minor character featured in the second part of the JoJo''s Bizarre Adventure series, Battle Tendency, and then the third part, Stardust Crusaders. She is Lisa Lisa''s servant, but a powerless human. Suzi Q becomes Joseph Joestar''s love interest and later wife.', TIMESTAMP WITH TIME ZONE '2020-01-03 09:52:59+00', 8957, FALSE);
	VALUES (60, 'Kars', 'Kars@jojo.com', '$2b$12$czP2UA1cUhEgRyges3EYcO04ppvr2ECJ/TfH7VBBLKOibga8rggZS', 'Kars', 'Kars (カーズ, Kāzu) is the main antagonist of the second part of the JoJo''s Bizarre Adventure series, Battle Tendency, and the second main antagonist of the series.', TIMESTAMP WITH TIME ZONE '2019-10-17 15:30:30+00', 7289, TRUE);
