	VALUES (224, 'Josuke_Higashikata', 'Josuke_Higashikata@jojo.com', '$2b$12$BN6OQm9M6o5uaAZgEmIu1uhnv86VZzN6xK.UkQSdM9Ojq7apsQ80K', 'Josuke Higashikata', '
Josuke Higashikata (東方 仗助, Higashikata Jōsuke) is the main protagonist of the fourth part of the JoJo''s Bizarre Adventure series, Diamond is Unbreakable, and the fourth JoJo of the series. He is the illegitimate son of Joseph Joestar and Tomoko Higashikata.', TIMESTAMP WITH TIME ZONE '2019-05-02 18:26:02+00', 6079, TRUE);
	VALUES (225, 'Okuyasu_Nijimura', 'Okuyasu_Nijimura@jojo.com', '$2b$12$pbjQaV7a5sR/FO1IGuGbZuB88pYs7GupA/h8FoNC9tuhITqQN3KxK', 'Okuyasu Nijimura', 'Okuyasu Nijimura (虹村 億泰, Nijimura Okuyasu) is a main ally featured in the fourth part of the JoJo''s Bizarre Adventure series, Diamond is Unbreakable.', TIMESTAMP WITH TIME ZONE '2019-08-18 01:06:05+00', 7297, TRUE);
	VALUES (226, 'Koichi_Hirose', 'Koichi_Hirose@jojo.com', '$2b$12$S/rjPZn4OE1d4WbhfxR51.Kk53nHRnrjEOS5nd7/9imRae9N/UE9m', 'Koichi Hirose', 'Koichi Hirose (広瀬 康一, Hirose Kōichi) is the deuteragonist of the fourth part of JoJo''s Bizarre Adventure, Diamond is Unbreakable. He also appears briefly as a minor ally in the fifth part, Vento Aureo, assisting Giorno Giovanna in the fight against Polpo''s Stand, Black Sabbath.', TIMESTAMP WITH TIME ZONE '2019-04-26 22:01:19+00', 3008, TRUE);
	VALUES (227, 'Rohan_Kishibe', 'Rohan_Kishibe@jojo.com', '$2b$12$chFjsPci5oG2yHnVmjcM7.eHODXbtq3ZgBiiTab3xXZkc3hiH9ksu', 'Rohan Kishibe', '
Rohan Kishibe (岸辺 露伴, Kishibe Rohan) is a main ally featured in the fourth part of the JoJo''s Bizarre Adventure series, Diamond is Unbreakable. First featured as an antagonist in the "Let''s Go to the Manga Artist''s House" story arc, he cooperates in the search for Yoshikage Kira.', TIMESTAMP WITH TIME ZONE '2018-10-12 16:06:46+00', 3312, TRUE);
	VALUES (228, 'Hayato_Kawajiri', 'Hayato_Kawajiri@jojo.com', '$2b$12$Qh1aWPsxKvoEuoHNxUvZVeofc1F/z66bT0b3ONyJ6Nf.CDvqrYNMq', 'Hayato Kawajiri', 'Hayato Kawajiri (川尻 早人, Kawajiri Hayato) is a major ally featured in the fourth part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, playing a crucial role in the "My Dad Is Not My Dad" and "Crazy Diamond is Unbreakable story arcs.', TIMESTAMP WITH TIME ZONE '2019-09-12 05:07:52+00', 983, TRUE);
	VALUES (229, 'Reimi_Sugimoto', 'Reimi_Sugimoto@jojo.com', '$2b$12$y9OYAIB1Gs7kWNTMex7SOuh6uc1t3sXflf0nyz/VV.1O7WWZL1RLa', 'Reimi Sugimoto', 'Reimi Sugimoto (杉本 鈴美, Sugimoto Reimi) is a major ally featured in the 4th part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, introduced in the "Rohan Kishibe''s Adventure" story arc.', TIMESTAMP WITH TIME ZONE '2018-02-03 00:05:52+00', 9609, TRUE);
	VALUES (230, 'Shigekiyo_Yangu', 'Shigekiyo_Yangu@jojo.com', '$2b$12$Fs5ZakGvYyyi.4r/fFegFexOJ33aVRy3X0bu7/d9IyyL5w32Bc0Be', 'Shigekiyo Yangu', '
Shigekiyo Yangu (矢安宮 重清, Yangū Shigekiyo), nicknamed Shigechi (重ちー, Shigechī), is a side character featured in the fourth part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, specifically in the "''Shigechi''s'' Harvest" and "Yoshikage Kira Just Wants to Live Quietly" story arcs.', TIMESTAMP WITH TIME ZONE '2019-06-20 12:56:11+00', 3587, TRUE);
	VALUES (231, 'Mikitaka_Hazekura', 'Mikitaka_Hazekura@jojo.com', '$2b$12$FRSDrdEWpFI6kCaUtkhGm.Zphsdxnba/XquXOKg0kIcFcZvgfXgji', 'Mikitaka Hazekura', 'Mikitaka Hazekura (支倉 未起隆, Hazekura Mikitaka), also self-proclaimed as Nu Mikitakazo Nshi (ヌ・ミキタカゾ・ンシ), is an ally featured in the 4th part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, specifically in the "I''m an Alien" and "Let''s Live on a Transmission Tower" story arcs.', TIMESTAMP WITH TIME ZONE '2019-11-19 00:53:22+00', 2892, TRUE);
	VALUES (232, 'Yukako_Yamagishi', 'Yukako_Yamagishi@jojo.com', '$2b$12$VzRtXAK9r9ceQlxGH87j3upIT3vldMlhE9PMPh4XHqIAy/yOyq1m6', 'Yukako Yamagishi', 'Yukako Yamagishi (山岸 由花子, Yamagishi Yukako) is a side character featured in the fourth part of the JoJo''s Bizarre Adventure series, Diamond is Unbreakable. Introduced as a minor antagonist in the "Yukako Yamagishi Falls In Love" story arc, she becomes a neutral character in the "Yukako Yamagishi Dreams of Cinderella" arc. ', TIMESTAMP WITH TIME ZONE '2019-04-06 05:22:56+00', 3207, TRUE);
	VALUES (233, 'Yuya_Fungami', 'Yuya_Fungami@jojo.com', '$2b$12$UV7Li8lzueBXsXDn9XxOwuizq83lYqbvkqUkMp6snC/deQclgiE7e', 'Yuya Fungami', 'Yuya Fungami (噴上 裕也, Fungami Yūya) is a minor character featured in the 4th part of JoJo''s Bizarre Adventure, Diamond is Unbreakable. Introduced as an antagonist in "Highway Star", he becomes an ally in "Enigma Boy".', TIMESTAMP WITH TIME ZONE '2020-05-08 01:22:01+00', 0, TRUE);
	VALUES (234, 'Tamami_Kobayashi', 'Tamami_Kobayashi@jojo.com', '$2b$12$Jj2EN2YqyQPkuny/XCbuWOnNKZ/G7723I8GqCwOo9Ftu5XupMHsRK', 'Tamami Kobayashi', '
Tamami Kobayashi (小林 玉美, Kobayashi Tamami) is a side character featured in the 4th part of JoJo''s Bizarre Adventure, Diamond is Unbreakable, introduced in the "Koichi Hirose (Echoes)" story arc.', TIMESTAMP WITH TIME ZONE '2018-12-09 07:46:59+00', 2114, TRUE);
	VALUES (235, 'Toshikazu_Hazamada', 'Toshikazu_Hazamada@jojo.com', '$2b$12$IXb4PIg8jVSUTUv/Mw8u.O6.xLRXbieYQUVm6oCWa19vI82tJz9a6', 'Toshikazu Hazamada', '
