	VALUES (570, 'Norisuke_Higashikata_IV', 'Norisuke_Higashikata_IV@jojo.com', '$2b$12$UmtNc5RiC055x/h54ScO9eayIn6eqqjpSMWyepfNpze6u39Z/oMjq', 'Norisuke Higashikata IV', '
Norisuke Higashikata IV (四代目東方 憲助, Yondaime Higashikata Norisuke), born Josuke Higashikata (東方常助, Higashikata Jōsuke), is an ally featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion.', TIMESTAMP WITH TIME ZONE '2019-02-22 00:06:28+00', 2498, TRUE);
	VALUES (571, 'Jobin_Higashikata', 'Jobin_Higashikata@jojo.com', '$2b$12$RCjxuSYZD4HGcUo.VlUSVuPu3wbMcaJy2A/n0cWjiKC9l/izoKZ4G', 'Jobin Higashikata', 'Jobin Higashikata (東方 常敏, Higashikata Jōbin) is a primary antagonist featured in the eighth part of the JoJo''s Bizarre Adventure series, JoJolion.', TIMESTAMP WITH TIME ZONE '2020-12-06 00:48:24+00', 5753, TRUE);
	VALUES (572, 'Mitsuba_Higashikata', 'Mitsuba_Higashikata@jojo.com', '$2b$12$bSyV5v3v7RUXjBeDrt/kseyYmdk7TZwyBjgh051ichmKTjGXEvgB6', 'Mitsuba Higashikata', 'Mitsuba Higashikata (東方 密葉, Higashikata Mitsuba) is a secondary character featured in the eighth part of the JoJo''s Bizarre Adventure series, JoJolion. Gaining significance during the "Doctor Wu and Awaking 3 Leaves" story arc, she becomes a temporary ally to Yasuho Hirose.', TIMESTAMP WITH TIME ZONE '2019-04-09 20:59:57+00', 4128, TRUE);
	VALUES (573, 'Tsurugi_Higashikata', 'Tsurugi_Higashikata@jojo.com', '$2b$12$FtiBA7/dZ.abPqqFjFwuguhrfEuqNtJLjV.mLrTA.6BxWVdVRKF92', 'Tsurugi Higashikata', 'Tsurugi Higashikata (東方 つるぎ, Higashikata Tsurugi) is a side character featured in the 8th part of JoJo''s Bizarre Adventure, JoJolion. Tsurugi cooperates with different factions during the course of the story.', TIMESTAMP WITH TIME ZONE '2020-06-07 18:05:43+00', 0, FALSE);
	VALUES (574, 'Joshu_Higashikata', 'Joshu_Higashikata@jojo.com', '$2b$12$B6xWxMcyHE0deQsVCOXqoOBZ8HePQtiqs4i1xBgc65sfSUqepUwN.', 'Joshu Higashikata', 'Joshu Higashikata (東方 常秀, Higashikata Jōshū) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion.', TIMESTAMP WITH TIME ZONE '2018-03-11 22:38:32+00', 8465, TRUE);
	VALUES (575, 'Hato_Higashikata', 'Hato_Higashikata@jojo.com', '$2b$12$Us1eHHtWzn7gJdYQnPAFjuZp6y8LJGkEx2jSWe4edv1Vep8hfn1BK', 'Hato Higashikata', 'Hato Higashikata (東方 鳩, Higashikata Hato) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. Introduced early in the story, she gains significance in the "Hato Brought Her Boyfriend Home" story arc and becomes a temporary ally in Walking Heart.', TIMESTAMP WITH TIME ZONE '2020-08-17 20:08:52+00', 7382, TRUE);
	VALUES (576, 'Daiya_Higashikata', 'Daiya_Higashikata@jojo.com', '$2b$12$tdrujnh0SZGvN.Q7fO7U4OWVCnufrKSnKB21H8m2boAvqHj2EGLsq', 'Daiya Higashikata', '
Daiya Higashikata (東方 大弥, Higashikata Daiya) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. Introduced as an antagonist in the "California King Bed" story arc, Daiya becomes a neutral character in subsequent arcs.', TIMESTAMP WITH TIME ZONE '2020-02-05 12:51:33+00', 4234, TRUE);
	VALUES (577, 'Kaato_Higashikata', 'Kaato_Higashikata@jojo.com', '$2b$12$TdSl2YUwlTIyEqDb0aUS9OFNe3/Gbj7iXCjeIqF5TCivVwCpuP4G6', 'Kaato Higashikata', 'Kaato Higashikata (東方 花都, Higashikata Kāto) is a tertiary character featured in the eighth part of the JoJo''s Bizarre Adventure series, JoJolion.', TIMESTAMP WITH TIME ZONE '2019-11-02 19:32:58+00', 506, TRUE);
	VALUES (578, 'Kei_Nijimura', 'Kei_Nijimura@jojo.com', '$2b$12$ZDZvwdeZHWPyVWkZj9ao9uiF89E094p.V/2htnCz9KYPj0qV6nma6', 'Kei Nijimura', 'Kei Nijimura (虹村 京, Nijimura Kei) is a minor ally featured in the eighth part of the JoJo''s Bizarre Adventure series, JoJolion. Appearing as an antagonist in the "Paisley Park and Born This Way" story arc, she then becomes an ally in "The Wonder of You (The Miracle of Your Love)" story arc.', TIMESTAMP WITH TIME ZONE '2020-08-23 04:43:54+00', 9491, TRUE);
	VALUES (579, 'Yoshikage_Kira_(JoJolion)', 'Yoshikage_Kira_(JoJolion)@jojo.com', '$2b$12$aabkql2hYNht3pYYfvL8eeQELOf9yk2WHv/fw.jbVQgIhKjRNlx9m', 'Yoshikage Kira (JoJolion)', 'Yoshikage Kira (吉良 吉影, Kira Yoshikage) is a character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. Introduced early in the story, Yoshikage gains significance in the "Vitamin C and Killer Queen" story arc.', TIMESTAMP WITH TIME ZONE '2018-04-07 19:21:24+00', 3550, TRUE);
	VALUES (580, 'Josefumi_Kujo', 'Josefumi_Kujo@jojo.com', '$2b$12$RZlotPWs5CTeAChgFDpzd.TB1IbJTUvKGpirgoEa9SzU0jW/AM/YG', 'Josefumi Kujo', 'Josefumi Kujo (空条 仗世文, Kūjō Josefumi) is a character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. Josefumi is alluded to in Love Love Deluxe, Part 2 but gains real significance in the "Vitamin C and Killer Queen" story arc.', TIMESTAMP WITH TIME ZONE '2019-08-16 09:11:30+00', 5319, TRUE);
	VALUES (581, 'Karera_Sakunami', 'Karera_Sakunami@jojo.com', '$2b$12$1Yd.ZqKMfv45EQvN7LsXHeipboQ0oZyX8LcI1SuCDS2D.9rz5c0N.', 'Karera Sakunami', 'Karera Sakunami (作並 カレラ, Sakunami Karera) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion, specifically the "Love Love Deluxe" story arc.', TIMESTAMP WITH TIME ZONE '2021-01-14 06:46:34+00', 0, TRUE);
	VALUES (582, 'Holy_Joestar-Kira', 'Holy_Joestar-Kira@jojo.com', '$2b$12$AbUOmoPanjDxS9wdsoi1huU/bZL2s6vgFySD5N/xsig1AzFHmc3wG', 'Holy Joestar-Kira', 'Holy Joestar-Kira (吉良・ホリー・ジョースター, Kira Horī Jōsutā) is a side character featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion. She is introduced in the ""Paisley Park" and "Born This Way"" story arc.', TIMESTAMP WITH TIME ZONE '2021-01-03 03:09:09+00', 5634, TRUE);
	VALUES (583, 'Tamaki_Damo', 'Tamaki_Damo@jojo.com', '$2b$12$oYbu5qpNYpX2/7ETTNrYXebhs1A5Gga4rR1W02k5pP3hgwpBI3zyi', 'Tamaki Damo', 'Tamaki Damo (田最 環, Damo Tamaki) is a major antagonist featured in the 8th part of JoJo''s Bizarre Adventure, JoJolion, and introduced in the "Hato Brought Her Boyfriend Home" story arc.', TIMESTAMP WITH TIME ZONE '2019-04-30 13:42:11+00', 9095, TRUE);
	VALUES (584, 'Yotsuyu_Yagiyama', 'Yotsuyu_Yagiyama@jojo.com', '$2b$12$vheOiRF6cmjyMkThmc.BUe3Pd3kpMnhPdu3wzA78dD5RyYJNcbi.q', 'Yotsuyu Yagiyama', 'Yotsuyu Yagiyama (八木山 夜露, Yagiyama Yotsuyu) is a minor antagonist featured in the eighth part of JoJo''s Bizarre Adventure, JoJolion, introduced in the "Norisuke Higashikata, Tsurugi Higashikata, and Yotsuyu Yagiyama" story arc.', TIMESTAMP WITH TIME ZONE '2020-05-31 14:37:40+00', 0, TRUE);
