	VALUES (36, 573, TIMESTAMP WITH TIME ZONE '2020-07-31 07:29:49+00', 'Achava muito contrários pareceres;
');
	VALUES (36, 573, TIMESTAMP WITH TIME ZONE '2020-07-31 09:51:26+00', 'Os Deuses em cadeiras de cristal,
');

	VALUES (37, 41, TIMESTAMP WITH TIME ZONE '2019-05-15 22:52:33+00', 'Esta foi Lusitânia, derivada
');

	VALUES (38, 42, TIMESTAMP WITH TIME ZONE '2019-05-22 21:34:29+00', '(Infiéis deixo) tantas heresias?
');
	VALUES (38, 675, TIMESTAMP WITH TIME ZONE '2019-05-23 05:18:53+00', 'Que enquanto Febo, de luz nunca escasso,
