');
	VALUES (38, 42, TIMESTAMP WITH TIME ZONE '2019-05-23 19:13:23+00', 'Que tudo ao Rei Fernando obedeceu.
');

	VALUES (39, 617, TIMESTAMP WITH TIME ZONE '2020-04-18 19:07:41+00', 'E assim a água, com ímpeto alterada,
