	VALUES (39, 617, TIMESTAMP WITH TIME ZONE '2020-04-19 01:04:56+00', 'Nem como o mole Rei Sardanapalo.
');
	VALUES (39, 42, TIMESTAMP WITH TIME ZONE '2020-04-19 02:47:42+00', 'Terá vitórias, terras e cidades,
