');
	VALUES (41, 44, TIMESTAMP WITH TIME ZONE '2019-11-27 22:13:37+00', '"Do justo e duro Pedro nasce o brando,
');

	VALUES (42, 592, TIMESTAMP WITH TIME ZONE '2019-12-19 13:01:51+00', 'Com o fogo que acendeu junto da serra
');
	VALUES (42, 45, TIMESTAMP WITH TIME ZONE '2019-12-19 15:19:40+00', 'Tais palavras do sábio peito abria:
