');

	VALUES (43, 45, TIMESTAMP WITH TIME ZONE '2019-11-25 10:44:50+00', 'Aquele que a salvar o mundo veio.
');

	VALUES (44, 418, TIMESTAMP WITH TIME ZONE '2020-03-03 06:46:52+00', 'Um rumor não soasse com verdade:
');

	VALUES (45, 457, TIMESTAMP WITH TIME ZONE '2020-02-09 16:09:47+00', 'Vinham as claras águas ajuntar-se,
');
	VALUES (45, 457, TIMESTAMP WITH TIME ZONE '2020-02-09 22:24:28+00', 'E se me esperas, não há mais que espere."
');

	VALUES (46, 58, TIMESTAMP WITH TIME ZONE '2020-08-19 13:57:56+00', 'Do Céu, e o pólo Antarctico ficava:
');
	VALUES (46, 532, TIMESTAMP WITH TIME ZONE '2020-08-19 15:17:38+00', 'O morador de Abila não se escusa,
');
	VALUES (46, 532, TIMESTAMP WITH TIME ZONE '2020-08-19 21:47:54+00', 'Com três rostos, debaxo vai Diana.
');
	VALUES (46, 532, TIMESTAMP WITH TIME ZONE '2020-08-19 22:43:26+00', 'Em ti o remédio certo que queremos.
');

	VALUES (47, 458, TIMESTAMP WITH TIME ZONE '2020-01-17 06:12:23+00', 'Esconde pera o Sul dificultoso;
');
	VALUES (47, 458, TIMESTAMP WITH TIME ZONE '2020-01-17 08:32:59+00', 'Entres a barra, tu com toda armada:
');
	VALUES (47, 59, TIMESTAMP WITH TIME ZONE '2020-01-17 09:01:55+00', 'Com as duas cabeças dos vigias,
');
	VALUES (47, 458, TIMESTAMP WITH TIME ZONE '2020-01-17 14:15:08+00', 'Ou que partes do mar corrido tinham?
');

	VALUES (48, 474, TIMESTAMP WITH TIME ZONE '2020-01-28 03:32:45+00', 'A nau da gente pérfida se enchia,
');
	VALUES (48, 59, TIMESTAMP WITH TIME ZONE '2020-01-28 08:27:55+00', 'Vós, que à custa de vossas várias mortes
');

	VALUES (49, 60, TIMESTAMP WITH TIME ZONE '2019-10-22 10:22:24+00', '"Aqui a fera batalha se encruece
');
	VALUES (49, 76, TIMESTAMP WITH TIME ZONE '2019-10-22 17:06:22+00', 'Altamente lhe dói perder a glória,
');
	VALUES (49, 60, TIMESTAMP WITH TIME ZONE '2019-10-22 20:51:05+00', 'A quem Fortuna sempre favorece,
');

	VALUES (50, 609, TIMESTAMP WITH TIME ZONE '2020-12-06 17:26:46+00', 'Sem vergonha o não digo, que a razão
');
	VALUES (50, 609, TIMESTAMP WITH TIME ZONE '2020-12-07 00:17:47+00', 'A Deusas é sagrada esta floresta.
');

	VALUES (51, 61, TIMESTAMP WITH TIME ZONE '2018-11-21 23:53:02+00', 'Tempo fuja de tua formosura!
');
	VALUES (51, 472, TIMESTAMP WITH TIME ZONE '2018-11-22 02:14:35+00', 'Foi pelos fortes Reis desbaratado,
');
	VALUES (51, 61, TIMESTAMP WITH TIME ZONE '2018-11-22 06:14:59+00', 'Enquanto se detêm em Inglaterra,
');
	VALUES (51, 472, TIMESTAMP WITH TIME ZONE '2018-11-22 06:58:00+00', 'Posto que em força e gente tão pequeno.
');

	VALUES (52, 684, TIMESTAMP WITH TIME ZONE '2021-03-20 02:01:54+00', 'Os que habitam o Arcturo congelado,
');
	VALUES (52, 684, TIMESTAMP WITH TIME ZONE '2021-03-20 05:52:50+00', 'E faz ir docemente murmurando
');
	VALUES (52, 62, TIMESTAMP WITH TIME ZONE '2021-03-20 08:07:44+00', '"Destarte a gente força e esforça Nuno,
');

	VALUES (53, 63, TIMESTAMP WITH TIME ZONE '2020-06-29 09:23:15+00', 'Quem viu sempre um estado deleitoso?
');
	VALUES (53, 63, TIMESTAMP WITH TIME ZONE '2020-06-29 16:13:30+00', 'Que nas asas da Fama se sustenha,
');
	VALUES (53, 422, TIMESTAMP WITH TIME ZONE '2020-06-29 21:52:12+00', 'Com desusada festa o nobre Gama.
');

	VALUES (54, 271, TIMESTAMP WITH TIME ZONE '2020-06-27 02:53:05+00', 'Não menos nesta terra experimentara
');
	VALUES (54, 63, TIMESTAMP WITH TIME ZONE '2020-06-27 03:58:46+00', 'Que ficasse aos futuros por exemplo.
');
	VALUES (54, 271, TIMESTAMP WITH TIME ZONE '2020-06-27 07:16:45+00', 'Usado a tomar na água a ave ferida,
');
	VALUES (54, 271, TIMESTAMP WITH TIME ZONE '2020-06-27 10:30:11+00', 'Das vitórias do Bárbaro, que acode
');

	VALUES (55, 321, TIMESTAMP WITH TIME ZONE '2020-02-18 15:18:39+00', 'Na praia um regedor do Reino estava,
');
	VALUES (55, 64, TIMESTAMP WITH TIME ZONE '2020-02-18 17:14:10+00', 'Estava a terra em montes revestida
');

	VALUES (56, 418, TIMESTAMP WITH TIME ZONE '2020-01-01 19:40:05+00', '"Ulisses é o que faz a santa casa
');
	VALUES (56, 418, TIMESTAMP WITH TIME ZONE '2020-01-01 22:40:02+00', 'Sois os dentes de Cadmo desparzidos,
');
	VALUES (56, 64, TIMESTAMP WITH TIME ZONE '2020-01-02 01:40:10+00', 'Daqui, tanto que Bóreas nos ventou,
');

	VALUES (57, 87, TIMESTAMP WITH TIME ZONE '2021-04-22 20:35:40+00', 'Do conhecido pólo de Calisto,
');
	VALUES (57, 87, TIMESTAMP WITH TIME ZONE '2021-04-22 20:52:06+00', 'De todos leva o colo alevantado;
');
	VALUES (57, 87, TIMESTAMP WITH TIME ZONE '2021-04-22 20:57:51+00', 'Do sucessor de Pedro, rebelado,
');
	VALUES (57, 87, TIMESTAMP WITH TIME ZONE '2021-04-23 00:17:26+00', '"Ser isto ordenação dos céus divina,
');

	VALUES (58, 69, TIMESTAMP WITH TIME ZONE '2021-04-27 13:59:52+00', 'Cavalos treme a terra, os vales soam;
');
	VALUES (58, 69, TIMESTAMP WITH TIME ZONE '2021-04-27 20:38:18+00', 'Assim falando entravam já na sala,
');
	VALUES (58, 66, TIMESTAMP WITH TIME ZONE '2021-04-28 01:36:51+00', 'E na harmonia e doce suavidade
');
	VALUES (58, 66, TIMESTAMP WITH TIME ZONE '2021-04-28 06:11:52+00', '"E não cuides, ó Rei, que não saísse
');

	VALUES (59, 313, TIMESTAMP WITH TIME ZONE '2021-02-16 15:31:48+00', 'Nem como o mole Rei Sardanapalo.
');

	VALUES (60, 67, TIMESTAMP WITH TIME ZONE '2020-06-15 01:13:32+00', 'Que eles, em campo raso ou estacada,
');
	VALUES (60, 67, TIMESTAMP WITH TIME ZONE '2020-06-15 08:30:08+00', 'Cantava dum que tem nos Malabares
');
	VALUES (60, 67, TIMESTAMP WITH TIME ZONE '2020-06-15 16:18:01+00', 'Sua memória e obras valerosas;
');

	VALUES (61, 260, TIMESTAMP WITH TIME ZONE '2021-01-17 21:36:08+00', 'Que fogo e frechas mil terão coberta.
');

	VALUES (62, 427, TIMESTAMP WITH TIME ZONE '2020-09-19 23:22:09+00', 'Lhe tinha aparelhados, que a fraqueza
');
	VALUES (62, 427, TIMESTAMP WITH TIME ZONE '2020-09-20 05:02:24+00', 'Que nunca falte um pérfido inimigo
');
	VALUES (62, 72, TIMESTAMP WITH TIME ZONE '2020-09-20 09:27:03+00', 'Tingindo a que deixou de escura noda,
');
	VALUES (62, 427, TIMESTAMP WITH TIME ZONE '2020-09-20 16:49:51+00', 'Uma cidade nela situada,
');

	VALUES (63, 465, TIMESTAMP WITH TIME ZONE '2020-10-18 01:20:59+00', 'Que a mãe, com seu marido, as manda e come,
');
	VALUES (63, 74, TIMESTAMP WITH TIME ZONE '2020-10-18 08:24:15+00', 'Surge diante a frota Lusitana,
');

	VALUES (64, 552, TIMESTAMP WITH TIME ZONE '2020-10-22 11:34:24+00', 'E que despacho já não esperava
');
	VALUES (64, 552, TIMESTAMP WITH TIME ZONE '2020-10-22 14:02:51+00', 'Não lhe aproveita já trabuco horrendo,
');

	VALUES (65, 518, TIMESTAMP WITH TIME ZONE '2021-01-14 06:26:58+00', 'Ó tu, Guarda Divina, tem cuidado
');
	VALUES (65, 75, TIMESTAMP WITH TIME ZONE '2021-01-14 07:43:57+00', 'Os montes de mais perto respondiam,
');
	VALUES (65, 75, TIMESTAMP WITH TIME ZONE '2021-01-14 08:40:53+00', 'No largo mar fazendo novas vias,
');

	VALUES (66, 204, TIMESTAMP WITH TIME ZONE '2019-12-04 13:19:40+00', 'Que menos é querer matar o irmão,
');

	VALUES (67, 246, TIMESTAMP WITH TIME ZONE '2020-10-23 16:43:52+00', 'E que aquele deleite, que tanto ama
');

	VALUES (68, 79, TIMESTAMP WITH TIME ZONE '2021-04-17 19:28:59+00', 'Manda-lhe dar piloto, que de jeito
');
	VALUES (68, 456, TIMESTAMP WITH TIME ZONE '2021-04-17 21:22:36+00', 'O Capitão, que não caía em nada
');
