');
	VALUES (68, 456, TIMESTAMP WITH TIME ZONE '2021-04-18 09:55:32+00', 'Para onde a forte armada se enxergava;
');

	VALUES (69, 81, TIMESTAMP WITH TIME ZONE '2020-05-18 03:08:56+00', 'O rio que Sevilha vai regando,
');
	VALUES (69, 438, TIMESTAMP WITH TIME ZONE '2020-05-18 04:27:13+00', 'Pois saberás que aqueles, que chegados
');

	VALUES (70, 81, TIMESTAMP WITH TIME ZONE '2020-06-24 16:27:23+00', 'Segundo estava mal apercebido.
