');
	VALUES (72, 458, TIMESTAMP WITH TIME ZONE '2020-03-23 01:01:07+00', 'Para seus senhorios se tornaram;
');

	VALUES (73, 141, TIMESTAMP WITH TIME ZONE '2020-04-11 21:24:03+00', 'Um lenho de grandeza desmedida.
