	VALUES (74, 147, TIMESTAMP WITH TIME ZONE '2019-12-12 07:00:34+00', 'Refrear o soberbo povo duro,
');

	VALUES (75, 586, TIMESTAMP WITH TIME ZONE '2018-02-22 11:37:20+00', 'Aqui de outras cidades, sem debate,
');
	VALUES (75, 87, TIMESTAMP WITH TIME ZONE '2018-02-22 15:21:17+00', '(Bem como o vento leva branca vela)
');

	VALUES (76, 335, TIMESTAMP WITH TIME ZONE '2020-10-09 10:30:35+00', 'Cantava dum que tem nos Malabares
');

	VALUES (77, 88, TIMESTAMP WITH TIME ZONE '2020-10-16 11:47:11+00', '"Assim passando aquelas regiões
');
	VALUES (77, 309, TIMESTAMP WITH TIME ZONE '2020-10-16 13:57:07+00', 'Do trabalho que nisso for tomado.
');

	VALUES (78, 89, TIMESTAMP WITH TIME ZONE '2021-04-22 10:33:57+00', 'Que quem da Hespéria última alongada,
');
	VALUES (78, 89, TIMESTAMP WITH TIME ZONE '2021-04-22 16:19:29+00', 'Arruinar a máquina do mundo:
');

	VALUES (79, 89, TIMESTAMP WITH TIME ZONE '2019-11-07 05:31:21+00', 'Quando a cidade entrada se rendera
');
	VALUES (79, 89, TIMESTAMP WITH TIME ZONE '2019-11-07 11:36:38+00', 'Que co''o Rei nobre as pazes concertasse,
');
	VALUES (79, 121, TIMESTAMP WITH TIME ZONE '2019-11-07 19:35:53+00', '"Que outrem possa louvar esforço alheio,
');
	VALUES (79, 121, TIMESTAMP WITH TIME ZONE '2019-11-07 21:07:38+00', 'Com muito pouco mais de cem soldados,
');

	VALUES (80, 202, TIMESTAMP WITH TIME ZONE '2020-04-28 03:38:40+00', 'Atenas, Ios, Argo e Salamina:
');
	VALUES (80, 90, TIMESTAMP WITH TIME ZONE '2020-04-28 09:14:41+00', 'Esconde o corpo n''água; outra se apressa
');
	VALUES (80, 90, TIMESTAMP WITH TIME ZONE '2020-04-28 17:14:39+00', 'Mas nem por ser do mundo a derradeira
');
	VALUES (80, 90, TIMESTAMP WITH TIME ZONE '2020-04-28 21:17:38+00', 'Co''o despojo da guerra e rica presa,
');

	VALUES (81, 90, TIMESTAMP WITH TIME ZONE '2020-06-08 00:24:05+00', 'O teu Rei tem a régia majestade,
');
	VALUES (81, 540, TIMESTAMP WITH TIME ZONE '2020-06-08 01:17:58+00', '"Sancho, forte mancebo, que ficara
');
	VALUES (81, 90, TIMESTAMP WITH TIME ZONE '2020-06-08 01:27:18+00', 'Que o grande aperto, em gente ainda que honrosa,
');

	VALUES (82, 91, TIMESTAMP WITH TIME ZONE '2019-11-03 02:38:11+00', 'E já depois que toda se escondeu,
');
	VALUES (82, 132, TIMESTAMP WITH TIME ZONE '2019-11-03 04:05:54+00', 'A terra, usada aos casos de Mavorte,
