	VALUES (82, 132, TIMESTAMP WITH TIME ZONE '2019-11-03 07:13:21+00', 'Que ora dos naturais Nobá se chama.
');
	VALUES (82, 91, TIMESTAMP WITH TIME ZONE '2019-11-03 14:18:33+00', 'Os dois que em gente as pedras converteram.
');

	VALUES (83, 94, TIMESTAMP WITH TIME ZONE '2018-07-03 02:17:26+00', 'A cidade de Silves tem cercado,
');
	VALUES (83, 638, TIMESTAMP WITH TIME ZONE '2018-07-03 08:38:47+00', 'Se defendem milhor dos inimigos;
');
	VALUES (83, 94, TIMESTAMP WITH TIME ZONE '2018-07-03 16:21:23+00', 'As cerejas purpúreas na pintura,
');

	VALUES (84, 205, TIMESTAMP WITH TIME ZONE '2019-10-01 21:41:41+00', 'Por tão bom Rei, por tão sublime gente.
');

	VALUES (85, 98, TIMESTAMP WITH TIME ZONE '2019-10-22 01:10:50+00', 'De minha gente a grão genealogia:
');
	VALUES (85, 98, TIMESTAMP WITH TIME ZONE '2019-10-22 07:47:25+00', 'Os montes Nabatêos acendido,
