	VALUES (85, 98, TIMESTAMP WITH TIME ZONE '2019-10-22 17:17:49+00', 'O Sol, que para o Norte os carros guia,
');

	VALUES (86, 99, TIMESTAMP WITH TIME ZONE '2020-04-26 13:30:19+00', 'De Viriato tanto se ilustraram,
');
	VALUES (86, 99, TIMESTAMP WITH TIME ZONE '2020-04-26 21:22:28+00', 'Dos povos de Mombaça pouco humanos.
');

	VALUES (87, 284, TIMESTAMP WITH TIME ZONE '2021-04-24 11:58:25+00', 'Julgando já Netuno que seria
');
	VALUES (87, 284, TIMESTAMP WITH TIME ZONE '2021-04-24 12:44:51+00', 'De escultura formosa estão lavradas,
');
	VALUES (87, 99, TIMESTAMP WITH TIME ZONE '2021-04-24 15:03:23+00', 'Príncipe em Guimarães está cercado
');

	VALUES (88, 310, TIMESTAMP WITH TIME ZONE '2018-10-31 06:56:13+00', 'Porém não lhe sucede muito bem.
');
	VALUES (88, 101, TIMESTAMP WITH TIME ZONE '2018-10-31 13:59:10+00', '"E tu, Padre de grande fortaleza,
');
	VALUES (88, 101, TIMESTAMP WITH TIME ZONE '2018-10-31 21:52:41+00', 'E por que cada dama um tenha certo,
');

	VALUES (89, 626, TIMESTAMP WITH TIME ZONE '2020-04-18 03:49:24+00', 'Jugo perpétuo, eterno cativeiro,
');
	VALUES (89, 101, TIMESTAMP WITH TIME ZONE '2020-04-18 07:42:00+00', 'E seus olhos em lágrimas banhados;
');
	VALUES (89, 626, TIMESTAMP WITH TIME ZONE '2020-04-18 15:27:08+00', 'Lhe maquinava, nada lhe concede,
');
	VALUES (89, 626, TIMESTAMP WITH TIME ZONE '2020-04-18 15:52:52+00', 'Com a presença e leda humanidade;
');

	VALUES (90, 102, TIMESTAMP WITH TIME ZONE '2021-01-18 23:41:11+00', 'Onde ora as águas nítidas de argento
');
	VALUES (90, 102, TIMESTAMP WITH TIME ZONE '2021-01-19 01:56:15+00', 'Malaios namorados, Jaus valentes,
');
	VALUES (90, 247, TIMESTAMP WITH TIME ZONE '2021-01-19 08:25:55+00', 'Desbaratareis tudo o que quiserdes,
');

	VALUES (91, 103, TIMESTAMP WITH TIME ZONE '2018-09-14 04:57:29+00', 'Com que Sinon os Frígios enganou:
');
	VALUES (91, 103, TIMESTAMP WITH TIME ZONE '2018-09-14 11:42:56+00', 'As Hercúleas colunas nas bandeiras.
');

	VALUES (92, 444, TIMESTAMP WITH TIME ZONE '2020-08-09 03:44:52+00', 'Enganos tão fingidos não alcança,
