	VALUES (92, 444, TIMESTAMP WITH TIME ZONE '2020-08-09 12:58:07+00', 'Que tão queridos tinha, e tão mimosos,
');

	VALUES (93, 602, TIMESTAMP WITH TIME ZONE '2020-12-04 17:19:48+00', 'Já não defenderá somente os passos,
');

	VALUES (94, 446, TIMESTAMP WITH TIME ZONE '2020-11-25 13:17:57+00', 'Os povos Abassis, de Crista amigos;
');
	VALUES (94, 446, TIMESTAMP WITH TIME ZONE '2020-11-25 13:38:35+00', 'Gente do fero Nuno, que os apouca.
');

	VALUES (95, 105, TIMESTAMP WITH TIME ZONE '2019-12-12 13:05:35+00', '"Corre raivosa, e freme, e com bramidos
');
	VALUES (95, 127, TIMESTAMP WITH TIME ZONE '2019-12-12 17:03:54+00', 'As marítimas águas consagradas,
');
	VALUES (95, 105, TIMESTAMP WITH TIME ZONE '2019-12-12 17:44:12+00', 'Debaixo dos pés duros dos ardentes
');

	VALUES (96, 360, TIMESTAMP WITH TIME ZONE '2020-12-26 20:38:01+00', 'E não menos de esforço aparelhados
');

	VALUES (97, 502, TIMESTAMP WITH TIME ZONE '2020-08-04 10:34:51+00', 'Não segue ele do Arábio a lei maldita,
');

	VALUES (98, 152, TIMESTAMP WITH TIME ZONE '2019-04-21 15:09:14+00', 'Para se desfazer uma alta serra,
');

	VALUES (99, 460, TIMESTAMP WITH TIME ZONE '2019-08-26 08:45:08+00', 'Noutras, à cabeceira, d''ouro finas,
');

	VALUES (100, 275, TIMESTAMP WITH TIME ZONE '2020-05-27 05:41:23+00', '"Virá despois Meneses, cujo ferro
');
	VALUES (100, 275, TIMESTAMP WITH TIME ZONE '2020-05-27 06:57:22+00', 'Sempiterno favor em seus amores,
');
	VALUES (100, 108, TIMESTAMP WITH TIME ZONE '2020-05-27 08:15:55+00', 'Depois que o salso mar a terra banha.
');

	VALUES (101, 108, TIMESTAMP WITH TIME ZONE '2020-03-26 02:37:02+00', 'A costa negra de África, e tornava
');
	VALUES (101, 120, TIMESTAMP WITH TIME ZONE '2020-03-26 05:19:49+00', '"Mas oh, que luz tamanha que abrir sinto
');

	VALUES (102, 110, TIMESTAMP WITH TIME ZONE '2019-08-25 07:04:39+00', 'Co''o peito desprezou firme e sereno,
');

	VALUES (103, 110, TIMESTAMP WITH TIME ZONE '2019-10-16 19:26:39+00', 'O que o sublime Gama contaria,
');
	VALUES (103, 182, TIMESTAMP WITH TIME ZONE '2019-10-16 20:37:48+00', 'Assim pela cidade caminhando,
');

	VALUES (104, 111, TIMESTAMP WITH TIME ZONE '2020-05-29 07:33:40+00', 'Bem fora que aqui Baco os sustentasse,
');
	VALUES (104, 117, TIMESTAMP WITH TIME ZONE '2020-05-29 11:18:52+00', 'Tu, que a todo Israel refúgio deste
');

	VALUES (105, 624, TIMESTAMP WITH TIME ZONE '2020-12-28 01:32:55+00', 'Praia, por vermos em que parte estou,
