');
	VALUES (205, 207, TIMESTAMP WITH TIME ZONE '2019-04-13 23:30:00+00', 'Posto que em todo o mundo, de afrontados,
');

	VALUES (206, 565, TIMESTAMP WITH TIME ZONE '2020-12-09 10:44:12+00', 'Teu valor alto, o fado quer que venhas
');
