	VALUES (309, 308, TIMESTAMP WITH TIME ZONE '2020-11-06 04:34:19+00', 'Cujo nome não pode ser defunto
');
	VALUES (309, 308, TIMESTAMP WITH TIME ZONE '2020-11-06 09:52:17+00', 'Logo, corno tornou do Reino o cargo,
');

	VALUES (310, 308, TIMESTAMP WITH TIME ZONE '2019-02-01 12:35:55+00', 'De nós o claro Sol, para julgares
');
	VALUES (310, 462, TIMESTAMP WITH TIME ZONE '2019-02-01 19:08:02+00', 'E vendo, sem contraste e sem braveza
');

	VALUES (311, 311, TIMESTAMP WITH TIME ZONE '2021-01-14 05:50:42+00', 'Desta vaidade, a quem chamamos Fama!
');
	VALUES (311, 626, TIMESTAMP WITH TIME ZONE '2021-01-14 06:06:37+00', 'Com que nos deixe o sono carregado?"
');

	VALUES (312, 311, TIMESTAMP WITH TIME ZONE '2021-02-19 13:27:30+00', 'Que lhe dizem que falta resistência
');
	VALUES (312, 631, TIMESTAMP WITH TIME ZONE '2021-02-19 20:59:29+00', 'Das águas, alguma ínsula divina,
');
	VALUES (312, 631, TIMESTAMP WITH TIME ZONE '2021-02-19 22:43:06+00', 'Para a frota, no seu batel ligeiro.
');
	VALUES (312, 311, TIMESTAMP WITH TIME ZONE '2021-02-20 05:09:53+00', 'Alimpamos as naus, que dos caminhos
');

	VALUES (313, 312, TIMESTAMP WITH TIME ZONE '2019-06-02 09:55:22+00', 'Do licor que Lieo prantado havia
');
	VALUES (313, 312, TIMESTAMP WITH TIME ZONE '2019-06-02 13:42:22+00', 'Que em vão assopra o vento, a vela inchando.
');
	VALUES (313, 312, TIMESTAMP WITH TIME ZONE '2019-06-02 21:41:27+00', 'Cercado, ao Sarraceno se entregava.
');

	VALUES (314, 694, TIMESTAMP WITH TIME ZONE '2019-03-05 17:36:49+00', 'Porém que, como a luz mostrar por onde
');

	VALUES (315, 517, TIMESTAMP WITH TIME ZONE '2019-11-30 11:00:07+00', 'Novas ilhas, que em torno cerca e lava.
');
	VALUES (315, 314, TIMESTAMP WITH TIME ZONE '2019-11-30 14:14:58+00', 'E com justo decreto assim permites
');

	VALUES (316, 314, TIMESTAMP WITH TIME ZONE '2019-12-19 23:48:21+00', 'A vida que se perde e que periga;
');

	VALUES (317, 316, TIMESTAMP WITH TIME ZONE '2018-07-10 22:13:56+00', 'Tanto poder, que tudo submetesse
');
	VALUES (317, 316, TIMESTAMP WITH TIME ZONE '2018-07-11 06:07:13+00', 'Que vêm por cima da água Netunina.
');
	VALUES (317, 316, TIMESTAMP WITH TIME ZONE '2018-07-11 08:08:40+00', '--"Rei tendes tal, que se o valor tiverdes
');

	VALUES (318, 510, TIMESTAMP WITH TIME ZONE '2020-05-16 22:11:18+00', 'Eis, de meus companheiros rodeado,
');
	VALUES (318, 510, TIMESTAMP WITH TIME ZONE '2020-05-17 03:17:37+00', 'Deseja o Rei, que andava edificando,
');
	VALUES (318, 510, TIMESTAMP WITH TIME ZONE '2020-05-17 04:31:50+00', 'Volvendo o rosto já sereno e santo,
');

	VALUES (319, 317, TIMESTAMP WITH TIME ZONE '2020-05-24 15:39:52+00', 'Se já não pões a tanta insânia freio,
');
	VALUES (319, 317, TIMESTAMP WITH TIME ZONE '2020-05-24 20:35:12+00', 'Em vários pensamentos se derrama;
');

	VALUES (320, 563, TIMESTAMP WITH TIME ZONE '2020-04-03 17:39:04+00', 'Me disse:--"As cousas árduas e lustrosas
');
	VALUES (320, 563, TIMESTAMP WITH TIME ZONE '2020-04-03 20:54:48+00', 'Torna sereno e claro o ar escuro,
');
	VALUES (320, 319, TIMESTAMP WITH TIME ZONE '2020-04-04 01:14:12+00', 'Bandeira, quando, excelsa e gloriosa,
');

	VALUES (321, 639, TIMESTAMP WITH TIME ZONE '2021-01-25 07:35:42+00', 'E de alguns que trazia condenados
');
	VALUES (321, 319, TIMESTAMP WITH TIME ZONE '2021-01-25 11:21:14+00', 'Estas palavras tais falando orava:
');

	VALUES (322, 442, TIMESTAMP WITH TIME ZONE '2019-05-20 17:08:22+00', 'Tinha por valor grande e mui subido
');
	VALUES (322, 324, TIMESTAMP WITH TIME ZONE '2019-05-20 23:54:41+00', 'Água das fontes, doce e cristalina;
');

	VALUES (323, 370, TIMESTAMP WITH TIME ZONE '2020-12-03 08:46:15+00', 'Todos foram de fraca carne humana.
');
	VALUES (323, 325, TIMESTAMP WITH TIME ZONE '2020-12-03 12:13:02+00', 'O pastor de Massília lhos furtara;
');

	VALUES (324, 326, TIMESTAMP WITH TIME ZONE '2021-01-07 07:47:33+00', 'Que tudo enfim, tu, puro amor, despreza,
');
	VALUES (324, 326, TIMESTAMP WITH TIME ZONE '2021-01-07 09:04:28+00', 'Do Tejo, pelo mar que o Gama abrira,
');
	VALUES (324, 326, TIMESTAMP WITH TIME ZONE '2021-01-07 15:03:22+00', 'Despede nisto o fero moço as setas
');
	VALUES (324, 689, TIMESTAMP WITH TIME ZONE '2021-01-07 17:08:58+00', 'Que o Rei se banha logo na água santa,
');

	VALUES (325, 326, TIMESTAMP WITH TIME ZONE '2019-06-04 05:53:14+00', '"Mas cá onde mais se alarga, ali tereis
');
	VALUES (325, 326, TIMESTAMP WITH TIME ZONE '2019-06-04 13:09:54+00', 'Nem sou da terra, nem da geração
');
	VALUES (325, 342, TIMESTAMP WITH TIME ZONE '2019-06-04 18:58:53+00', 'Que mil vezes dizendo suspirava,
');
	VALUES (325, 342, TIMESTAMP WITH TIME ZONE '2019-06-04 20:36:02+00', 'Casa etérea do Olimpo onipotente,
');

	VALUES (326, 329, TIMESTAMP WITH TIME ZONE '2020-06-04 15:19:51+00', 'Destes trabalhos graves e temores,
');

	VALUES (327, 595, TIMESTAMP WITH TIME ZONE '2020-03-17 22:32:02+00', 'Mas com virtudes, certo, singulares,
');
	VALUES (327, 595, TIMESTAMP WITH TIME ZONE '2020-03-18 03:13:01+00', 'Quando o Rei Melindano se embarcava
');
	VALUES (327, 595, TIMESTAMP WITH TIME ZONE '2020-03-18 10:08:51+00', 'Ouviu-o o Douro e a terra Transtagana;
');

	VALUES (328, 408, TIMESTAMP WITH TIME ZONE '2020-01-20 08:17:38+00', 'Do terreno, fazendo-o Quersoneso.
');
	VALUES (328, 408, TIMESTAMP WITH TIME ZONE '2020-01-20 11:09:24+00', 'Em breve os Mouros tem desbaratados.
');
	VALUES (328, 408, TIMESTAMP WITH TIME ZONE '2020-01-20 13:17:36+00', 'Tomais mil vezes, e no torpe e escuro
');

	VALUES (329, 333, TIMESTAMP WITH TIME ZONE '2019-10-27 02:06:06+00', 'Que tão diversas partes conquistou;
');

	VALUES (330, 619, TIMESTAMP WITH TIME ZONE '2018-08-12 14:03:36+00', 'Dos espumantes vasos se derrama
');
	VALUES (330, 619, TIMESTAMP WITH TIME ZONE '2018-08-12 15:19:44+00', 'Da natureza e do úmido elemento,
');
	VALUES (330, 333, TIMESTAMP WITH TIME ZONE '2018-08-12 17:49:24+00', '"Vê-lo cá vai com os filhos a entregar-se,
');

	VALUES (331, 334, TIMESTAMP WITH TIME ZONE '2019-02-07 20:09:51+00', 'Que a ferrugem da paz gastadas tinha;
');
	VALUES (331, 618, TIMESTAMP WITH TIME ZONE '2019-02-07 21:06:29+00', 'Que por muito e por muito que se afinem
');
	VALUES (331, 618, TIMESTAMP WITH TIME ZONE '2019-02-08 00:00:01+00', 'Cuidou que entre estes Mouros o tomasse;
');

	VALUES (332, 334, TIMESTAMP WITH TIME ZONE '2019-01-04 18:07:43+00', 'O touro busca, e pondo-se diante,
');
	VALUES (332, 334, TIMESTAMP WITH TIME ZONE '2019-01-05 01:54:55+00', 'Co''os delicados pés a areia ardente.
');
	VALUES (332, 630, TIMESTAMP WITH TIME ZONE '2019-01-05 02:01:16+00', 'Co''o despojo da guerra e rica presa,
');

	VALUES (333, 534, TIMESTAMP WITH TIME ZONE '2020-09-04 18:39:52+00', '"Todas de correr cansam, Ninfa pura,
');
	VALUES (333, 534, TIMESTAMP WITH TIME ZONE '2020-09-04 22:31:36+00', 'Às aves variadas, que ali saltam,
');

	VALUES (334, 644, TIMESTAMP WITH TIME ZONE '2021-01-14 04:42:28+00', 'Quando as águas co''o sangue do adversário
');
	VALUES (334, 644, TIMESTAMP WITH TIME ZONE '2021-01-14 11:28:00+00', 'Já para se entregar quase movidos
');
	VALUES (334, 644, TIMESTAMP WITH TIME ZONE '2021-01-14 11:39:30+00', 'Já que minha presença não te agrada,
');
	VALUES (334, 337, TIMESTAMP WITH TIME ZONE '2021-01-14 17:53:18+00', 'Cai a soberba Inglesa de seu trono,
');

	VALUES (335, 340, TIMESTAMP WITH TIME ZONE '2018-11-10 02:25:48+00', 'Mas da que se me faz também a mi;
');

	VALUES (336, 341, TIMESTAMP WITH TIME ZONE '2020-03-22 17:47:39+00', 'Que a mais obriga amor mal empregado.
');
	VALUES (336, 617, TIMESTAMP WITH TIME ZONE '2020-03-22 21:47:22+00', 'Daqui levarás tudo tão sobejo
');

	VALUES (337, 342, TIMESTAMP WITH TIME ZONE '2018-04-25 06:04:35+00', 'Jugo de Reis diversos o constrange
');
	VALUES (337, 498, TIMESTAMP WITH TIME ZONE '2018-04-25 06:18:01+00', 'Do mar, que sobejaram, tudo o ofende.
');
	VALUES (337, 342, TIMESTAMP WITH TIME ZONE '2018-04-25 13:54:57+00', 'O nome tem co as obras derivado;
');

	VALUES (338, 342, TIMESTAMP WITH TIME ZONE '2019-05-01 00:09:42+00', 'Branda seda e fino ouro dá também.
');

	VALUES (339, 436, TIMESTAMP WITH TIME ZONE '2018-11-01 08:47:01+00', 'Pisando o cristalino Céu formoso,
');
	VALUES (339, 343, TIMESTAMP WITH TIME ZONE '2018-11-01 09:23:58+00', 'Ela com tristes o piedosas vozes,
');
	VALUES (339, 343, TIMESTAMP WITH TIME ZONE '2018-11-01 16:28:46+00', 'Chegada a frota ao rico senhorio,
');

	VALUES (340, 594, TIMESTAMP WITH TIME ZONE '2018-11-07 04:23:24+00', 'Naquele por quem morro, criarei
');
	VALUES (340, 343, TIMESTAMP WITH TIME ZONE '2018-11-07 12:18:51+00', 'Deste corpo, e começo os olhos belos
');
	VALUES (340, 343, TIMESTAMP WITH TIME ZONE '2018-11-07 14:06:44+00', 'Se vingam só do peito que as comete;
');

	VALUES (341, 344, TIMESTAMP WITH TIME ZONE '2020-10-13 03:51:41+00', 'Com doce voz está subindo ao Céu
');

	VALUES (342, 346, TIMESTAMP WITH TIME ZONE '2020-09-14 06:14:39+00', 'Os que foram roubar a bela Helena,
');
	VALUES (342, 346, TIMESTAMP WITH TIME ZONE '2020-09-14 12:08:41+00', '"O ramo que lhe vês para divisa,
');
	VALUES (342, 384, TIMESTAMP WITH TIME ZONE '2020-09-14 12:51:38+00', 'Aqueles que nos Reinos lá da Aurora
');

	VALUES (343, 526, TIMESTAMP WITH TIME ZONE '2018-07-01 00:18:07+00', 'Faça-se como Baco determina;
');
	VALUES (343, 526, TIMESTAMP WITH TIME ZONE '2018-07-01 06:21:08+00', 'Que menos é querer matar o irmão,
');
	VALUES (343, 526, TIMESTAMP WITH TIME ZONE '2018-07-01 08:34:40+00', 'Uns caem meios mortos, e outros vão
');
	VALUES (343, 346, TIMESTAMP WITH TIME ZONE '2018-07-01 12:30:34+00', 'A cor que tinha Dafne nos cabelos;
');

	VALUES (344, 669, TIMESTAMP WITH TIME ZONE '2019-04-29 16:48:43+00', 'Os formosos limões ali, cheirando,
');
	VALUES (344, 669, TIMESTAMP WITH TIME ZONE '2019-04-29 19:05:11+00', 'Ouçam todos o mal, que toca a todos."
');
	VALUES (344, 669, TIMESTAMP WITH TIME ZONE '2019-04-30 00:51:55+00', 'E de Ainão vê a incógnita enseada;
');
	VALUES (344, 669, TIMESTAMP WITH TIME ZONE '2019-04-30 04:07:44+00', 'Eneias e Quirino, e os dois Tebanos,
');

	VALUES (345, 351, TIMESTAMP WITH TIME ZONE '2020-04-23 14:29:29+00', 'Nos não querem deixar viver seguros,
');

	VALUES (346, 351, TIMESTAMP WITH TIME ZONE '2020-03-26 06:50:56+00', 'Pintou de ruivas conchas Citereia.
');

	VALUES (347, 515, TIMESTAMP WITH TIME ZONE '2019-10-29 22:56:27+00', 'Cometendo as bombardas, que, nos ares,
');
	VALUES (347, 515, TIMESTAMP WITH TIME ZONE '2019-10-30 01:07:17+00', 'Sobre o potente Reino de Castela.
');
	VALUES (347, 515, TIMESTAMP WITH TIME ZONE '2019-10-30 07:18:13+00', 'Segundo o que desejas de saber,
');
	VALUES (347, 515, TIMESTAMP WITH TIME ZONE '2019-10-30 11:36:14+00', 'Que viram largos anos, largos meses,
');

	VALUES (348, 689, TIMESTAMP WITH TIME ZONE '2021-01-12 15:37:48+00', 'A bomba, que nos imos alagando!"
');
	VALUES (348, 689, TIMESTAMP WITH TIME ZONE '2021-01-12 19:22:35+00', 'Dentre as Ninfas se vai, que saudosas
');
	VALUES (348, 689, TIMESTAMP WITH TIME ZONE '2021-01-12 23:58:27+00', 'Lisboa, de si dando santa prova?
');
	VALUES (348, 353, TIMESTAMP WITH TIME ZONE '2021-01-13 02:36:37+00', 'Foi sem fazer na carne detrimento
');

	VALUES (349, 362, TIMESTAMP WITH TIME ZONE '2020-03-24 00:42:29+00', 'Não é sem causa, não, oculta e escura,
');
	VALUES (349, 353, TIMESTAMP WITH TIME ZONE '2020-03-24 03:16:00+00', 'Foi sem fazer na carne detrimento
');
	VALUES (349, 353, TIMESTAMP WITH TIME ZONE '2020-03-24 07:48:11+00', 'Que sempre ante seus olhos te traziam,
');

	VALUES (350, 517, TIMESTAMP WITH TIME ZONE '2019-06-18 05:38:52+00', 'A tento estava o Rei na segurança
');

	VALUES (351, 360, TIMESTAMP WITH TIME ZONE '2020-11-17 16:28:41+00', 'O valeroso ofício de Minerva;
');
	VALUES (351, 360, TIMESTAMP WITH TIME ZONE '2020-11-17 23:38:10+00', 'Buscando algum remédio a meus pesares,
');
	VALUES (351, 357, TIMESTAMP WITH TIME ZONE '2020-11-18 07:19:09+00', 'Coelho de outra parti, e o Mauritano;
');
	VALUES (351, 357, TIMESTAMP WITH TIME ZONE '2020-11-18 12:53:09+00', 'Ora da Terra estão caminho breve,
');

	VALUES (352, 530, TIMESTAMP WITH TIME ZONE '2021-03-13 17:58:09+00', '"Martim Lopes se chama o cavaleiro,
');
	VALUES (352, 357, TIMESTAMP WITH TIME ZONE '2021-03-13 21:16:38+00', 'Dos altos feitos grandes e subidos.
');
	VALUES (352, 357, TIMESTAMP WITH TIME ZONE '2021-03-14 00:12:16+00', 'Dizei-mo sem temor de infâmia ou morte,
');

	VALUES (353, 440, TIMESTAMP WITH TIME ZONE '2021-02-11 22:05:37+00', 'Baticalá, que vira já Beadala.
');
	VALUES (353, 440, TIMESTAMP WITH TIME ZONE '2021-02-12 02:58:08+00', 'A mercê grande a Deus agradeceu.
');
	VALUES (353, 440, TIMESTAMP WITH TIME ZONE '2021-02-12 03:00:11+00', 'O velho pai sesudo, que respeita
');

	VALUES (354, 359, TIMESTAMP WITH TIME ZONE '2021-01-21 22:50:19+00', 'Do Lusitano o preço grande e raro,
');

	VALUES (355, 620, TIMESTAMP WITH TIME ZONE '2020-11-12 06:40:34+00', 'Descendo pelos ásperos outeiros,
');
	VALUES (355, 360, TIMESTAMP WITH TIME ZONE '2020-11-12 07:51:22+00', 'Vede que fresca fonte rega as flores,
');

	VALUES (356, 488, TIMESTAMP WITH TIME ZONE '2018-07-20 17:47:24+00', 'Co''os panos e co''os braços acenavam
');
	VALUES (356, 362, TIMESTAMP WITH TIME ZONE '2018-07-20 23:07:55+00', 'Estava o claro dia memorado,
');

	VALUES (357, 363, TIMESTAMP WITH TIME ZONE '2020-07-21 05:32:35+00', 'Destarte se esclarece o entendimento,
');
	VALUES (357, 363, TIMESTAMP WITH TIME ZONE '2020-07-21 12:36:33+00', 'Crendo que seu engano estava noto,
');

	VALUES (358, 363, TIMESTAMP WITH TIME ZONE '2020-11-07 22:15:03+00', 'Uniforme, perfeito, em si sustido,
');
	VALUES (358, 363, TIMESTAMP WITH TIME ZONE '2020-11-07 23:41:15+00', 'Manda logo os feitores Lusitanos
');
	VALUES (358, 469, TIMESTAMP WITH TIME ZONE '2020-11-08 02:18:47+00', 'Em que três Reis das partes do Oriento
');
	VALUES (358, 469, TIMESTAMP WITH TIME ZONE '2020-11-08 05:44:32+00', 'Os que foram roubar a bela Helena,
');

	VALUES (359, 581, TIMESTAMP WITH TIME ZONE '2021-02-17 17:50:15+00', 'Que veja e saiba o mundo que do Tejo
');

	VALUES (360, 526, TIMESTAMP WITH TIME ZONE '2021-02-02 23:36:25+00', 'A alevantar com eles a fiança,
');
	VALUES (360, 526, TIMESTAMP WITH TIME ZONE '2021-02-03 04:41:30+00', 'Não tocava na gente de Samária.
');

	VALUES (361, 645, TIMESTAMP WITH TIME ZONE '2020-12-31 13:18:19+00', 'Vencidos vêm do sono, e mal despertos;
');
	VALUES (361, 367, TIMESTAMP WITH TIME ZONE '2020-12-31 16:48:42+00', 'Como já o fero Huno o foi primeiro
');

	VALUES (362, 373, TIMESTAMP WITH TIME ZONE '2021-05-14 20:15:30+00', 'Se já não pões a tanta insânia freio,
');
	VALUES (362, 373, TIMESTAMP WITH TIME ZONE '2021-05-15 02:17:56+00', 'Em que o Rei Castelhano já aguardava
');
	VALUES (362, 367, TIMESTAMP WITH TIME ZONE '2021-05-15 08:03:53+00', '"Eis as lanças e espadas retiniam
');
	VALUES (362, 367, TIMESTAMP WITH TIME ZONE '2021-05-15 14:43:38+00', 'E num portátil leito uma rica cama
');

	VALUES (363, 691, TIMESTAMP WITH TIME ZONE '2020-08-24 20:01:48+00', 'defenderá Nhaia com destreza.
');
	VALUES (363, 369, TIMESTAMP WITH TIME ZONE '2020-08-24 23:01:40+00', 'E vós, ó poderosos, por pastoras
');
	VALUES (363, 691, TIMESTAMP WITH TIME ZONE '2020-08-25 04:05:37+00', 'Sofrerá suas cidades e lugares,
');

	VALUES (364, 370, TIMESTAMP WITH TIME ZONE '2020-12-30 17:42:08+00', 'Nos Filípicos campos se vingaram.
');
	VALUES (364, 379, TIMESTAMP WITH TIME ZONE '2020-12-30 22:21:19+00', 'Cabo de Jasque, dito já Carpela,
');

	VALUES (365, 371, TIMESTAMP WITH TIME ZONE '2019-12-22 00:21:07+00', '"As mulheres queimadas vêm em cima
');
	VALUES (365, 593, TIMESTAMP WITH TIME ZONE '2019-12-22 08:05:43+00', 'Vês? já a vila de Alcáçare se humilha,
');

	VALUES (366, 510, TIMESTAMP WITH TIME ZONE '2019-04-21 21:58:31+00', 'Os toldos pelas águas arrojando;
');

	VALUES (367, 372, TIMESTAMP WITH TIME ZONE '2020-10-11 03:04:42+00', 'Sobre as asas ínclitas da Fama,
');
	VALUES (367, 655, TIMESTAMP WITH TIME ZONE '2020-10-11 07:49:15+00', 'Na primeira figura se detinha
');
	VALUES (367, 655, TIMESTAMP WITH TIME ZONE '2020-10-11 14:22:23+00', '"Vês corre a costa célebre Indiana
');

	VALUES (368, 468, TIMESTAMP WITH TIME ZONE '2021-04-14 07:58:28+00', 'Tenha firme, segura, limpa e branda;
');
	VALUES (368, 373, TIMESTAMP WITH TIME ZONE '2021-04-14 14:03:16+00', 'O mais cheiroso incenso pera as aras;
');
	VALUES (368, 468, TIMESTAMP WITH TIME ZONE '2021-04-14 20:47:54+00', 'Que má tenção, que peito em nós se sente,
');

	VALUES (369, 381, TIMESTAMP WITH TIME ZONE '2021-05-15 16:37:49+00', 'De esperas, basiliscos e trabucos,
');
	VALUES (369, 381, TIMESTAMP WITH TIME ZONE '2021-05-15 21:34:35+00', 'Com a adarga e co''a hástia perigosa,
');

	VALUES (370, 376, TIMESTAMP WITH TIME ZONE '2021-04-27 08:41:00+00', 'Mas sempre fora dele maltratado,
');
	VALUES (370, 482, TIMESTAMP WITH TIME ZONE '2021-04-27 11:40:01+00', 'Pelo Brúsio, Suécio e frio Dano.
');
	VALUES (370, 376, TIMESTAMP WITH TIME ZONE '2021-04-27 13:22:37+00', 'Já o Rei tem preso e a vila descercada:
');

	VALUES (371, 377, TIMESTAMP WITH TIME ZONE '2021-02-11 03:49:00+00', 'O vento dorme, o mar e as ondas jazem.
');
	VALUES (371, 377, TIMESTAMP WITH TIME ZONE '2021-02-11 11:27:19+00', 'Longos do mar, vêm sórdidas e imundas.
');

	VALUES (372, 377, TIMESTAMP WITH TIME ZONE '2019-04-04 19:28:13+00', '"Julgas agora, Rei, se houve no mundo
');
	VALUES (372, 377, TIMESTAMP WITH TIME ZONE '2019-04-04 23:41:41+00', 'Pelo escuro Hemisfério sonolento;
');

	VALUES (373, 434, TIMESTAMP WITH TIME ZONE '2020-01-17 03:59:59+00', 'Por muito grande espaço repetisses!
');
	VALUES (373, 434, TIMESTAMP WITH TIME ZONE '2020-01-17 09:53:40+00', 'Agora meio rosto, agora inteiro
');

	VALUES (374, 613, TIMESTAMP WITH TIME ZONE '2019-12-23 19:30:50+00', 'Que não somente, ousados, se contentam
');
	VALUES (374, 613, TIMESTAMP WITH TIME ZONE '2019-12-23 20:35:38+00', 'Trabucos feros, minas encobertas,
');

	VALUES (375, 379, TIMESTAMP WITH TIME ZONE '2019-10-02 21:17:07+00', 'Mas quantos a meu Rei forem contrários."--
');
	VALUES (375, 379, TIMESTAMP WITH TIME ZONE '2019-10-03 04:49:44+00', 'E por mais namorar o soberano
');
	VALUES (375, 620, TIMESTAMP WITH TIME ZONE '2019-10-03 09:25:37+00', 'Se quiserdes no mundo ser tamanhos,
');

	VALUES (376, 555, TIMESTAMP WITH TIME ZONE '2019-05-21 20:42:02+00', 'De Arábia e Pérsias terras abundantes.
');
	VALUES (376, 555, TIMESTAMP WITH TIME ZONE '2019-05-22 04:14:00+00', 'Respondeu:--"Qual será o amor bastante
');

	VALUES (377, 687, TIMESTAMP WITH TIME ZONE '2019-09-30 12:53:50+00', 'Que todo o mar de Ninfas povoara;
');

	VALUES (378, 381, TIMESTAMP WITH TIME ZONE '2020-09-22 01:27:17+00', 'Tudo o Gentio nota; mas o intento
');
	VALUES (378, 574, TIMESTAMP WITH TIME ZONE '2020-09-22 06:12:37+00', 'Que a tão altas empresas aspirava,
');
	VALUES (378, 381, TIMESTAMP WITH TIME ZONE '2020-09-22 07:54:03+00', 'Agora pelos úmidos caminhos.
');
