	VALUES (449, 652, TIMESTAMP WITH TIME ZONE '2018-08-24 03:38:01+00', 'Onde o violento fogo, com ruido,
');

	VALUES (450, 451, TIMESTAMP WITH TIME ZONE '2018-10-04 05:21:33+00', 'Se viu ferver Leucate, quando Augusto
');
