	VALUES (460, 650, TIMESTAMP WITH TIME ZONE '2020-03-24 01:07:32+00', 'Quem de meu pranto e de meu mal se risse,
');
	VALUES (460, 650, TIMESTAMP WITH TIME ZONE '2020-03-24 03:31:53+00', 'No Malabar, pera que, amedrontado,
');

	VALUES (461, 556, TIMESTAMP WITH TIME ZONE '2019-12-12 18:54:35+00', 'Abraçados as almas soltarão
');
	VALUES (461, 556, TIMESTAMP WITH TIME ZONE '2019-12-12 20:03:27+00', 'Com jogos, danças e outras alegrias,
