');
	VALUES (463, 461, TIMESTAMP WITH TIME ZONE '2021-03-25 14:29:59+00', 'Os áureos freios com feroz semblante;
');
	VALUES (463, 461, TIMESTAMP WITH TIME ZONE '2021-03-25 19:34:18+00', '"E se, agravadas damas, sois servidas,
');

