	VALUES (468, 466, TIMESTAMP WITH TIME ZONE '2018-05-20 04:03:31+00', 'Consente, porque sabe por verdade,
');
	VALUES (468, 466, TIMESTAMP WITH TIME ZONE '2018-05-20 07:53:47+00', 'Meliapor, fermosa, grande e rica;
');
	VALUES (468, 466, TIMESTAMP WITH TIME ZONE '2018-05-20 14:36:51+00', 'Que o grande aperto, em gente ainda que honrosa,
');

	VALUES (469, 645, TIMESTAMP WITH TIME ZONE '2021-01-06 20:00:03+00', 'Ditosa pátria que tal filho teve!
');
	VALUES (469, 645, TIMESTAMP WITH TIME ZONE '2021-01-07 02:19:47+00', 'Dina empresa tomar de ser cantada,
');
	VALUES (469, 467, TIMESTAMP WITH TIME ZONE '2021-01-07 09:50:42+00', 'Sobre ouro natural, que Amor enfia?
');
	VALUES (469, 645, TIMESTAMP WITH TIME ZONE '2021-01-07 17:12:08+00', 'Que os corações humanos tanto obriga,
');

	VALUES (470, 468, TIMESTAMP WITH TIME ZONE '2021-01-13 02:34:18+00', 'Andais de vosso sangue, ó gente insana!
');
	VALUES (470, 468, TIMESTAMP WITH TIME ZONE '2021-01-13 09:40:47+00', 'De corrupção os corpos no combate,
');

	VALUES (471, 469, TIMESTAMP WITH TIME ZONE '2020-11-19 20:26:18+00', 'Se é cristal o que vê, se diamante,
