');
	VALUES (471, 691, TIMESTAMP WITH TIME ZONE '2020-11-20 03:33:34+00', 'Digno feito de ser no mundo eterno,
');

	VALUES (472, 559, TIMESTAMP WITH TIME ZONE '2020-12-07 12:57:44+00', 'Já chegam perto, e não com passos lentos,
');
	VALUES (472, 559, TIMESTAMP WITH TIME ZONE '2020-12-07 14:19:59+00', 'E quem vos fez molesto tratamento,
');

