');
	VALUES (479, 662, TIMESTAMP WITH TIME ZONE '2020-04-11 21:37:23+00', 'A terra, usada aos casos de Mavorte,
');
	VALUES (479, 477, TIMESTAMP WITH TIME ZONE '2020-04-12 03:11:56+00', 'Diante do pai ledo, que a agasalha,
');

