');
	VALUES (483, 479, TIMESTAMP WITH TIME ZONE '2020-04-04 08:29:35+00', 'E que enquanto seu corpo o espírito reja,
');

	VALUES (484, 508, TIMESTAMP WITH TIME ZONE '2020-07-13 04:48:21+00', 'Da morte, da fazenda despendida,
');

	VALUES (485, 487, TIMESTAMP WITH TIME ZONE '2020-09-09 09:07:52+00', 'Vão as naus uma e uma rodeando,
