	VALUES (487, 692, TIMESTAMP WITH TIME ZONE '2019-07-14 06:27:55+00', 'Com ferro, incêndios, ira e crueldade,
');

	VALUES (488, 482, TIMESTAMP WITH TIME ZONE '2018-12-10 19:28:44+00', 'Conforme sucessor ao sucedido,
');
	VALUES (488, 544, TIMESTAMP WITH TIME ZONE '2018-12-10 22:02:34+00', 'A branca areia as lágrimas banhavam,
');
	VALUES (488, 544, TIMESTAMP WITH TIME ZONE '2018-12-10 23:51:24+00', 'Que os peitos generosos enobrece,
');

	VALUES (489, 666, TIMESTAMP WITH TIME ZONE '2020-05-21 20:23:59+00', 'Que nunca brando pentem conheceram;
');
	VALUES (489, 483, TIMESTAMP WITH TIME ZONE '2020-05-22 01:55:21+00', 'üa façanha faz esclarecida:
');
	VALUES (489, 666, TIMESTAMP WITH TIME ZONE '2020-05-22 03:26:46+00', 'Por que o tronco dos Reis se santifique."
');
	VALUES (489, 666, TIMESTAMP WITH TIME ZONE '2020-05-22 09:14:16+00', 'Dos estranhos, quem são; que ouvido tinha
');

	VALUES (490, 483, TIMESTAMP WITH TIME ZONE '2020-06-20 08:06:59+00', 'Nascem da tirania inimicícias,
');

	VALUES (491, 602, TIMESTAMP WITH TIME ZONE '2020-06-02 15:22:07+00', 'Perístera, as boninas apanhando.
');

	VALUES (492, 484, TIMESTAMP WITH TIME ZONE '2020-05-31 01:02:36+00', 'A qualquer coração amedrontado.
');
	VALUES (492, 484, TIMESTAMP WITH TIME ZONE '2020-05-31 01:55:40+00', 'Como cabeça ali de Europa toda,
');

	VALUES (493, 571, TIMESTAMP WITH TIME ZONE '2020-12-14 11:21:37+00', 'Foi a batalha tão sanguina e fera,
');
	VALUES (493, 486, TIMESTAMP WITH TIME ZONE '2020-12-14 19:11:50+00', 'Senão contentamento e gosto tanto,
');
	VALUES (493, 571, TIMESTAMP WITH TIME ZONE '2020-12-15 00:02:49+00', 'Vão a Mênfis e às terras, que se regam
');
	VALUES (493, 571, TIMESTAMP WITH TIME ZONE '2020-12-15 01:11:10+00', 'Que outrem cometa a fúria de Nereu.
');

	VALUES (494, 489, TIMESTAMP WITH TIME ZONE '2021-03-13 22:34:27+00', 'De quem virtude deve ser prezada.
');
	VALUES (494, 489, TIMESTAMP WITH TIME ZONE '2021-03-13 22:50:14+00', 'Por que me deixas, mísera e mesquinha?
');
	VALUES (494, 636, TIMESTAMP WITH TIME ZONE '2021-03-14 02:36:40+00', 'Que Gonçalo Ribeiro se nomeia,
');
	VALUES (494, 636, TIMESTAMP WITH TIME ZONE '2021-03-14 04:12:46+00', 'Versos; isso só louva, isso deseja.
');

	VALUES (495, 522, TIMESTAMP WITH TIME ZONE '2019-10-09 18:12:05+00', 'As rãs, no tempo antigo Lícia gente,
');
	VALUES (495, 522, TIMESTAMP WITH TIME ZONE '2019-10-09 20:14:25+00', 'O largo mundo, enquanto repousasse.
');
	VALUES (495, 522, TIMESTAMP WITH TIME ZONE '2019-10-10 01:22:24+00', 'Bem como o antigo Jano se pintava;
');

	VALUES (496, 566, TIMESTAMP WITH TIME ZONE '2020-09-24 02:59:53+00', 'Porque, saindo a gente descuidada,
');
	VALUES (496, 490, TIMESTAMP WITH TIME ZONE '2020-09-24 09:51:14+00', 'De teus feitos ilustres a ruína,
');
	VALUES (496, 490, TIMESTAMP WITH TIME ZONE '2020-09-24 15:27:57+00', 'São para nos matarem e roubarem,
');

	VALUES (497, 607, TIMESTAMP WITH TIME ZONE '2020-12-03 11:36:10+00', 'Nos muros de Bizâncio e de Turquia.
');
	VALUES (497, 490, TIMESTAMP WITH TIME ZONE '2020-12-03 12:46:16+00', 'Que entre as correntes Indicas se encerra,
');
	VALUES (497, 490, TIMESTAMP WITH TIME ZONE '2020-12-03 20:39:05+00', 'Virão lograr os gostos desta Ilha,
');

	VALUES (498, 643, TIMESTAMP WITH TIME ZONE '2020-10-01 15:25:24+00', 'Confessar-me a verdade limpa e nua,
');
	VALUES (498, 643, TIMESTAMP WITH TIME ZONE '2020-10-01 17:50:29+00', 'Tanto que estas palavras acabou,
');
	VALUES (498, 491, TIMESTAMP WITH TIME ZONE '2020-10-01 23:22:43+00', 'As águas campo deixam às cidades,
');
	VALUES (498, 491, TIMESTAMP WITH TIME ZONE '2020-10-02 00:39:33+00', 'Tudo faz a vital necessidade."
');

	VALUES (499, 492, TIMESTAMP WITH TIME ZONE '2020-04-30 21:23:41+00', '"Logo todo o restante se partiu
');

	VALUES (500, 492, TIMESTAMP WITH TIME ZONE '2019-12-26 03:57:12+00', '--"Ó Potestade, disse, sublimada!
');

	VALUES (501, 598, TIMESTAMP WITH TIME ZONE '2021-02-09 22:39:45+00', 'Notando o estrangeiro modo e uso,
');

	VALUES (502, 582, TIMESTAMP WITH TIME ZONE '2021-01-04 11:30:34+00', 'E pela costa abaixo o mar abrirmos
');
	VALUES (502, 582, TIMESTAMP WITH TIME ZONE '2021-01-04 18:31:13+00', 'Vos vêm tomar a vossa antiga terra,
');
	VALUES (502, 582, TIMESTAMP WITH TIME ZONE '2021-01-05 02:23:12+00', 'Que ali nas ondas entra, a não vista arte,
');
	VALUES (502, 582, TIMESTAMP WITH TIME ZONE '2021-01-05 09:38:46+00', 'Mais que pera mandar, os Portugueses.
');

	VALUES (503, 495, TIMESTAMP WITH TIME ZONE '2021-03-04 17:25:38+00', 'A ajuda convocando do Alcorão.
');
	VALUES (503, 581, TIMESTAMP WITH TIME ZONE '2021-03-04 21:47:10+00', 'E com títulos novos se ilustrou.
');

	VALUES (504, 571, TIMESTAMP WITH TIME ZONE '2020-12-22 01:29:08+00', 'Interesse maior do que lhe vinha,
');

	VALUES (505, 634, TIMESTAMP WITH TIME ZONE '2019-06-16 18:16:07+00', 'Como se fora pérfida inimiga.
');

	VALUES (506, 585, TIMESTAMP WITH TIME ZONE '2019-07-25 22:01:31+00', 'E casar-se com ela, de enlevado
');

	VALUES (507, 498, TIMESTAMP WITH TIME ZONE '2018-05-07 22:40:20+00', 'Que a socorrê-la vinha diligente
');

	VALUES (508, 591, TIMESTAMP WITH TIME ZONE '2020-05-28 06:03:46+00', 'Comendadores vence e o gado apanha,
');
	VALUES (508, 499, TIMESTAMP WITH TIME ZONE '2020-05-28 10:26:23+00', 'E diz que, porque o Sol no mar se esconde,
');
	VALUES (508, 499, TIMESTAMP WITH TIME ZONE '2020-05-28 16:45:46+00', 'De minha gente a grão genealogia:
');

	VALUES (509, 499, TIMESTAMP WITH TIME ZONE '2021-04-27 04:56:58+00', 'Dele em Germânia, com que a morte engane;
');
	VALUES (509, 623, TIMESTAMP WITH TIME ZONE '2021-04-27 09:20:18+00', 'Nem se sabe ainda, não, te afirmo e asselo,
');

	VALUES (510, 568, TIMESTAMP WITH TIME ZONE '2021-03-31 02:53:47+00', 'Todas numa ilha juntas e subidas,
');
	VALUES (510, 500, TIMESTAMP WITH TIME ZONE '2021-03-31 07:25:30+00', 'Os quais verás que jazem mais a dentro
');

	VALUES (511, 542, TIMESTAMP WITH TIME ZONE '2020-03-15 15:13:13+00', 'De ouro, e de seda e de algodão tecida.
');
	VALUES (511, 542, TIMESTAMP WITH TIME ZONE '2020-03-15 23:12:53+00', 'Da terra os naturais lhe chamam Gate,
');
	VALUES (511, 542, TIMESTAMP WITH TIME ZONE '2020-03-16 02:04:24+00', 'Cobrem ouro e aljôfar ao veludo.
');
	VALUES (511, 501, TIMESTAMP WITH TIME ZONE '2020-03-16 05:09:05+00', 'Dando os corpos a fomes e vigias,
');

	VALUES (512, 502, TIMESTAMP WITH TIME ZONE '2020-06-22 13:43:49+00', 'Ou nos amostra a terra que buscamos,
');
	VALUES (512, 576, TIMESTAMP WITH TIME ZONE '2020-06-22 13:55:56+00', 'Do que lhe der a língua conselheira.
');
	VALUES (512, 576, TIMESTAMP WITH TIME ZONE '2020-06-22 20:26:58+00', 'Aqui se estreita, aqui se alarga, quando
');
	VALUES (512, 502, TIMESTAMP WITH TIME ZONE '2020-06-22 20:57:20+00', 'E todos tereis mais, o nenhum menos;
');

	VALUES (513, 502, TIMESTAMP WITH TIME ZONE '2021-02-21 06:58:09+00', 'Pela praia brincando vem diante
');
	VALUES (513, 502, TIMESTAMP WITH TIME ZONE '2021-02-21 13:32:41+00', 'Onde pode acolher-se um fraco humano,
');
	VALUES (513, 502, TIMESTAMP WITH TIME ZONE '2021-02-21 15:23:23+00', 'Bradando-vos estão que o povo bruto
');

	VALUES (514, 653, TIMESTAMP WITH TIME ZONE '2020-11-24 16:15:45+00', 'Se estende uma fralda estreita, que combate
');

	VALUES (515, 688, TIMESTAMP WITH TIME ZONE '2020-09-26 21:43:36+00', 'Mole se fez e fraco; e bem parece,
');
	VALUES (515, 688, TIMESTAMP WITH TIME ZONE '2020-09-27 00:53:52+00', 'Glória vã não pretende nem dinheiro.
');
	VALUES (515, 503, TIMESTAMP WITH TIME ZONE '2020-09-27 06:14:27+00', 'Que pôde sustentar o grande peso
');

	VALUES (516, 522, TIMESTAMP WITH TIME ZONE '2020-11-28 13:20:23+00', 'Posto que todos Etíopes eram,
');
	VALUES (516, 522, TIMESTAMP WITH TIME ZONE '2020-11-28 14:40:29+00', 'Enxerga bem que as naus deseja perto
');
	VALUES (516, 522, TIMESTAMP WITH TIME ZONE '2020-11-28 21:21:11+00', 'Que a tua estátua ilustre não tivera
');
	VALUES (516, 522, TIMESTAMP WITH TIME ZONE '2020-11-28 23:40:05+00', 'Que depois foi de Abranches nobre Conde,
');

	VALUES (517, 505, TIMESTAMP WITH TIME ZONE '2021-01-02 12:25:43+00', 'De Cristãos, sendo o teu tão largo e tanto,
');

	VALUES (518, 557, TIMESTAMP WITH TIME ZONE '2019-05-22 02:39:03+00', 'E do Orionte o gesto turbulento;
');
	VALUES (518, 506, TIMESTAMP WITH TIME ZONE '2019-05-22 07:28:39+00', '"É Veloso no braço confiado,
');
	VALUES (518, 506, TIMESTAMP WITH TIME ZONE '2019-05-22 14:48:35+00', 'Que tão pequena parte sois no inundo;
');

	VALUES (519, 506, TIMESTAMP WITH TIME ZONE '2020-11-03 02:37:08+00', 'E faz vir a passar o último dano:
');
	VALUES (519, 506, TIMESTAMP WITH TIME ZONE '2020-11-03 09:05:38+00', 'Que o menor mal de todos seja a morte.
');
	VALUES (519, 655, TIMESTAMP WITH TIME ZONE '2020-11-03 16:17:02+00', '"Começa-se a travar a incerta guerra;
');
	VALUES (519, 506, TIMESTAMP WITH TIME ZONE '2020-11-03 18:03:39+00', '"Contarei, disse, sem que me repreendam
');

	VALUES (520, 507, TIMESTAMP WITH TIME ZONE '2019-04-28 13:30:10+00', 'O grande rio, onde batendo soa
');
	VALUES (520, 600, TIMESTAMP WITH TIME ZONE '2019-04-28 19:41:44+00', 'As que o Rei manda aos nobres cavaleiros,
');
	VALUES (520, 600, TIMESTAMP WITH TIME ZONE '2019-04-29 00:08:56+00', 'Para onde em santa vida acabe, e ande.
');

	VALUES (521, 508, TIMESTAMP WITH TIME ZONE '2020-07-07 16:49:51+00', 'A nenhum grande humano concedidos
');
	VALUES (521, 508, TIMESTAMP WITH TIME ZONE '2020-07-07 18:02:04+00', 'E de não ter das armas sempre os calos.
');
	VALUES (521, 606, TIMESTAMP WITH TIME ZONE '2020-07-07 20:50:08+00', 'Com enganosa e grande cortesia,
');

	VALUES (522, 508, TIMESTAMP WITH TIME ZONE '2020-06-28 00:57:36+00', 'Estrangeiros na terra, Lei e nação;
');
	VALUES (522, 625, TIMESTAMP WITH TIME ZONE '2020-06-28 06:45:39+00', 'E as que o Termodonte já gostaram.
');

	VALUES (523, 511, TIMESTAMP WITH TIME ZONE '2021-05-03 07:19:31+00', 'Etérea e elemental, que fabricada
');
	VALUES (523, 511, TIMESTAMP WITH TIME ZONE '2021-05-03 10:26:46+00', 'Festeja a companhia Lusitana,
');
	VALUES (523, 589, TIMESTAMP WITH TIME ZONE '2021-05-03 10:28:21+00', '"Destruirá a cidade Repelim,
');

	VALUES (524, 667, TIMESTAMP WITH TIME ZONE '2020-07-23 02:42:51+00', 'A maior parte aqui passam do dia
');
	VALUES (524, 667, TIMESTAMP WITH TIME ZONE '2020-07-23 05:31:11+00', 'Daqui aos Malabares, por contrato
');
	VALUES (524, 667, TIMESTAMP WITH TIME ZONE '2020-07-23 09:25:06+00', 'Não sem sangue, porém, que nele geme
');
	VALUES (524, 667, TIMESTAMP WITH TIME ZONE '2020-07-23 11:27:35+00', 'Ouvido tinha aos Fados que viria
');

	VALUES (525, 623, TIMESTAMP WITH TIME ZONE '2021-04-05 17:24:10+00', 'Já pelo ar o Cileneu voava;
');
	VALUES (525, 623, TIMESTAMP WITH TIME ZONE '2021-04-06 00:47:49+00', 'Que com cem olhos vê, e por onde voa,
');
	VALUES (525, 514, TIMESTAMP WITH TIME ZONE '2021-04-06 03:40:28+00', 'Cuja valia, e obras tanto amaste,
');

	VALUES (526, 593, TIMESTAMP WITH TIME ZONE '2020-01-15 20:54:26+00', 'Quero, se me deixais, ir só por terra,
');
	VALUES (526, 516, TIMESTAMP WITH TIME ZONE '2020-01-15 21:31:22+00', 'Aceso de ira, o Cão, não vendo lassos
');
	VALUES (526, 516, TIMESTAMP WITH TIME ZONE '2020-01-15 23:03:31+00', 'Que de teu Rei me deste, que é fingida;
');
	VALUES (526, 593, TIMESTAMP WITH TIME ZONE '2020-01-16 05:34:19+00', 'Sigue-me firme e forte, com prudência,
');

	VALUES (527, 516, TIMESTAMP WITH TIME ZONE '2021-04-19 09:37:43+00', 'Mas põe em vida os ainda não nascidos.
');
	VALUES (527, 684, TIMESTAMP WITH TIME ZONE '2021-04-19 11:57:08+00', 'Os mais exprimentados levantai-os,
');
	VALUES (527, 684, TIMESTAMP WITH TIME ZONE '2021-04-19 14:19:23+00', 'Que de quebrar-lhe a nau lhe mete medo.
');
	VALUES (527, 516, TIMESTAMP WITH TIME ZONE '2021-04-19 18:25:36+00', 'Não vos hão-de faltar, gente famosa,
');

	VALUES (528, 521, TIMESTAMP WITH TIME ZONE '2020-12-18 12:28:02+00', 'Mais célebre por nome que por fama:
');
	VALUES (528, 521, TIMESTAMP WITH TIME ZONE '2020-12-18 15:59:39+00', 'Ousou algum a ver do mar profundo,
');

	VALUES (529, 519, TIMESTAMP WITH TIME ZONE '2019-12-25 23:35:23+00', 'Presos, afora a presa que tiveram?
');
	VALUES (529, 519, TIMESTAMP WITH TIME ZONE '2019-12-26 01:21:59+00', '--"Contudo, por livrarmos o Oceano
');

	VALUES (530, 653, TIMESTAMP WITH TIME ZONE '2020-12-20 00:11:26+00', 'Outros quebram com o peito duro a barra;
');
	VALUES (530, 653, TIMESTAMP WITH TIME ZONE '2020-12-20 01:45:13+00', '"Mas antes, valeroso Capitão,
');
	VALUES (530, 653, TIMESTAMP WITH TIME ZONE '2020-12-20 04:35:13+00', 'De poder ver o povo batizado,
');
	VALUES (530, 521, TIMESTAMP WITH TIME ZONE '2020-12-20 11:31:25+00', '"Mas na Índia, cobiça e ambição,
');

	VALUES (531, 570, TIMESTAMP WITH TIME ZONE '2019-06-07 21:42:06+00', 'Do que eu vi, a poder de esforço e de arte,
');

	VALUES (532, 648, TIMESTAMP WITH TIME ZONE '2019-09-26 22:49:04+00', 'E não porque conselho lhe falece,
');
	VALUES (532, 522, TIMESTAMP WITH TIME ZONE '2019-09-26 23:55:40+00', 'Onde súbito se acha vencedora.
');

	VALUES (533, 676, TIMESTAMP WITH TIME ZONE '2019-09-13 09:09:58+00', 'Inclinam seu propósito e porfia
');

	VALUES (534, 527, TIMESTAMP WITH TIME ZONE '2021-04-22 22:29:10+00', 'Determinei por armas de tomá-la,
');
	VALUES (534, 527, TIMESTAMP WITH TIME ZONE '2021-04-23 06:19:36+00', 'Mais há-de ser um brando companheiro
');

	VALUES (535, 657, TIMESTAMP WITH TIME ZONE '2021-04-13 09:46:33+00', 'Um deles a presença traz cansada,
');
	VALUES (535, 657, TIMESTAMP WITH TIME ZONE '2021-04-13 16:47:27+00', 'Da gente que vem ver a leda armada,
');

	VALUES (536, 683, TIMESTAMP WITH TIME ZONE '2020-12-25 08:42:41+00', 'De ver que, cometendo tal caminho,
');
	VALUES (536, 528, TIMESTAMP WITH TIME ZONE '2020-12-25 09:17:55+00', 'Que com pactos de paz sempre ancoravam.
');
	VALUES (536, 528, TIMESTAMP WITH TIME ZONE '2020-12-25 09:44:07+00', '"Assim contava, e com um medonho choro
');
	VALUES (536, 683, TIMESTAMP WITH TIME ZONE '2020-12-25 11:34:09+00', 'Estando na cidade, cujo prado
');

	VALUES (537, 528, TIMESTAMP WITH TIME ZONE '2021-01-23 11:49:26+00', 'Já finalmente todos assentados
');

	VALUES (538, 634, TIMESTAMP WITH TIME ZONE '2021-01-30 02:19:39+00', 'Te contei tudo quanto me pediste.
');

	VALUES (539, 530, TIMESTAMP WITH TIME ZONE '2021-03-18 22:56:19+00', 'Bem o mostra o Gentio a quem o entenda,
');
	VALUES (539, 530, TIMESTAMP WITH TIME ZONE '2021-03-19 02:21:43+00', 'Ardis de guerra mil o Mouro iroso;
');

	VALUES (540, 690, TIMESTAMP WITH TIME ZONE '2020-05-09 17:30:42+00', 'A natura sem Lei e sem razão.
');
	VALUES (540, 531, TIMESTAMP WITH TIME ZONE '2020-05-09 21:10:26+00', '"Olha a terra de Ulcinde, fertilíssima,
');

	VALUES (541, 531, TIMESTAMP WITH TIME ZONE '2021-01-05 02:55:01+00', '"E vereis o mar Roxo, tão famoso,
');
	VALUES (541, 531, TIMESTAMP WITH TIME ZONE '2021-01-05 06:19:52+00', 'Vão todos os que dentro tem no seio;
');
	VALUES (541, 531, TIMESTAMP WITH TIME ZONE '2021-01-05 08:06:30+00', '"Somos, um dos das ilhas lhe tornou,
');

	VALUES (542, 644, TIMESTAMP WITH TIME ZONE '2021-01-16 12:04:22+00', 'E morre o descoberto aventuroso.
');
	VALUES (542, 644, TIMESTAMP WITH TIME ZONE '2021-01-16 17:38:00+00', 'Fazem direito e vã severidade:
');
	VALUES (542, 644, TIMESTAMP WITH TIME ZONE '2021-01-16 20:24:57+00', 'Senão com algum conto de alegria,
');
	VALUES (542, 532, TIMESTAMP WITH TIME ZONE '2021-01-17 04:06:21+00', '"Olha estoutro debaxo, que esmaltado
');

	VALUES (543, 532, TIMESTAMP WITH TIME ZONE '2021-03-26 13:53:30+00', 'Da morte, da fazenda despendida,
');
	VALUES (543, 532, TIMESTAMP WITH TIME ZONE '2021-03-26 19:57:24+00', 'Que encherão todo o mar, co a férrea pela,
');

	VALUES (544, 534, TIMESTAMP WITH TIME ZONE '2020-09-15 03:36:06+00', 'De ser na Ogígia ilha eterno escravo,
');
	VALUES (544, 534, TIMESTAMP WITH TIME ZONE '2020-09-15 09:03:09+00', 'A armada de Netuno, que eu buscava.
');
	VALUES (544, 534, TIMESTAMP WITH TIME ZONE '2020-09-15 12:08:34+00', 'Dele mui largamente se informava
');
	VALUES (544, 534, TIMESTAMP WITH TIME ZONE '2020-09-15 14:34:46+00', 'Fizeram, só por armas tão subidos,
');

	VALUES (545, 535, TIMESTAMP WITH TIME ZONE '2021-03-04 11:38:50+00', 'Que fez igual o efeito ao pensamento,
');
	VALUES (545, 535, TIMESTAMP WITH TIME ZONE '2021-03-04 18:42:10+00', 'Que primeiro desejos o acabaram.
');
	VALUES (545, 535, TIMESTAMP WITH TIME ZONE '2021-03-04 21:55:40+00', 'Vingarás, co valor de ilustres peitos.
');

	VALUES (546, 535, TIMESTAMP WITH TIME ZONE '2021-01-20 05:14:10+00', 'Em brincos amorosos mal tratada,
');

	VALUES (547, 536, TIMESTAMP WITH TIME ZONE '2020-02-13 06:51:30+00', 'Que, só por não quebrar cos singulares
');
	VALUES (547, 536, TIMESTAMP WITH TIME ZONE '2020-02-13 11:39:44+00', 'Que ficasse aos futuros por exemplo.
');
	VALUES (547, 561, TIMESTAMP WITH TIME ZONE '2020-02-13 12:57:37+00', 'Daqui levarás tudo tão sobejo
');
	VALUES (547, 536, TIMESTAMP WITH TIME ZONE '2020-02-13 16:22:26+00', 'Inspira imortal canto e voz divina
');

	VALUES (548, 536, TIMESTAMP WITH TIME ZONE '2020-02-21 05:21:04+00', 'Em Canúsio, relíquias sós de Canas,
');

	VALUES (549, 648, TIMESTAMP WITH TIME ZONE '2021-03-19 20:08:41+00', 'Que dum vassalo meu o nome toma,
');

	VALUES (550, 537, TIMESTAMP WITH TIME ZONE '2021-04-04 03:19:36+00', 'Em vida e morte, de honra e alegria.
');
	VALUES (550, 537, TIMESTAMP WITH TIME ZONE '2021-04-04 03:50:14+00', 'Outros com vozes, com que o céu feriam,
');

	VALUES (551, 539, TIMESTAMP WITH TIME ZONE '2020-01-18 18:22:22+00', 'Que trazido de Roma o nome têm,
');
	VALUES (551, 539, TIMESTAMP WITH TIME ZONE '2020-01-18 18:30:32+00', 'Daqueles, que debaixo da bandeira
');
	VALUES (551, 614, TIMESTAMP WITH TIME ZONE '2020-01-18 21:02:01+00', 'Merencório no gesto parecia;
');
	VALUES (551, 539, TIMESTAMP WITH TIME ZONE '2020-01-19 00:15:36+00', 'Se sabe esta malícia, a qual asinha
');

	VALUES (552, 612, TIMESTAMP WITH TIME ZONE '2020-07-15 09:25:41+00', 'Mas já a amorosa estrela cintilava
');
	VALUES (552, 540, TIMESTAMP WITH TIME ZONE '2020-07-15 12:44:06+00', 'Do mar incerto, tímidos e ledos;
');
	VALUES (552, 540, TIMESTAMP WITH TIME ZONE '2020-07-15 19:09:31+00', 'Volvendo, ora se abaxe, agora se erga,
');
	VALUES (552, 612, TIMESTAMP WITH TIME ZONE '2020-07-15 23:01:49+00', 'E pela costa abaixo o mar abrirmos
');

	VALUES (553, 542, TIMESTAMP WITH TIME ZONE '2020-01-15 23:49:30+00', 'Contando assim Veloso, já a companha
');
	VALUES (553, 542, TIMESTAMP WITH TIME ZONE '2020-01-16 05:09:45+00', 'As palavras dum vago navegante.
');

	VALUES (554, 542, TIMESTAMP WITH TIME ZONE '2019-06-14 00:44:01+00', 'Bravos em vista e feros nos aspectos,
');

	VALUES (555, 543, TIMESTAMP WITH TIME ZONE '2021-03-12 20:18:45+00', 'Por que cresçam as rendas e abastanças,
');
	VALUES (555, 558, TIMESTAMP WITH TIME ZONE '2021-03-12 23:38:13+00', 'Ouvir quiseres como se nomeia,
');
	VALUES (555, 543, TIMESTAMP WITH TIME ZONE '2021-03-13 05:11:23+00', 'Na pátria, onde profeta ninguém é,
');

	VALUES (556, 691, TIMESTAMP WITH TIME ZONE '2020-09-21 08:48:39+00', 'Promete-lhos o Mouro, com tenção
');
	VALUES (556, 543, TIMESTAMP WITH TIME ZONE '2020-09-21 13:48:19+00', 'Já pelo nome antigo tão famosa
');

	VALUES (557, 608, TIMESTAMP WITH TIME ZONE '2020-07-09 22:16:23+00', 'Fingidos de mortal e cego engano.
');
	VALUES (557, 545, TIMESTAMP WITH TIME ZONE '2020-07-10 02:47:35+00', 'Apartadas assim da ardente costa
');
	VALUES (557, 608, TIMESTAMP WITH TIME ZONE '2020-07-10 06:32:10+00', 'E com títulos novos se ilustrou.
');
	VALUES (557, 545, TIMESTAMP WITH TIME ZONE '2020-07-10 09:38:40+00', 'Da Índia, Pérsia, Arábia e de Etiópia?
');

	VALUES (558, 546, TIMESTAMP WITH TIME ZONE '2020-09-21 07:02:01+00', 'O Gama, que ali mostra a vária tinta,
');
	VALUES (558, 575, TIMESTAMP WITH TIME ZONE '2020-09-21 12:36:55+00', 'Que só vosso favor me não faleça,
');
	VALUES (558, 546, TIMESTAMP WITH TIME ZONE '2020-09-21 16:27:23+00', 'Soltar palavras graves de ousadia,
');

	VALUES (559, 604, TIMESTAMP WITH TIME ZONE '2020-07-19 13:30:42+00', 'Que nunca se verá tão forte peito,
');
	VALUES (559, 604, TIMESTAMP WITH TIME ZONE '2020-07-19 15:25:03+00', 'Nela vê, como tinha por costume,
');
	VALUES (559, 547, TIMESTAMP WITH TIME ZONE '2020-07-19 15:38:12+00', 'Que ali quis dar aos já cansados ossos
');
	VALUES (559, 547, TIMESTAMP WITH TIME ZONE '2020-07-19 22:57:52+00', 'No Reino e nos altivos pensamentos,
');

	VALUES (560, 627, TIMESTAMP WITH TIME ZONE '2020-06-08 11:13:02+00', 'Contando assim Veloso, já a companha
');
	VALUES (560, 547, TIMESTAMP WITH TIME ZONE '2020-06-08 12:51:40+00', 'Por que razão lhe impede e lhe difere
');
	VALUES (560, 627, TIMESTAMP WITH TIME ZONE '2020-06-08 13:13:32+00', 'Deste Deus-Homem, alto e infinito,
');
	VALUES (560, 547, TIMESTAMP WITH TIME ZONE '2020-06-08 20:00:57+00', '"Conceito digno foi do ramo claro
');

	VALUES (561, 586, TIMESTAMP WITH TIME ZONE '2018-10-31 00:46:09+00', 'Ali co''o Tigre o Eufrates se mistura,
');
	VALUES (561, 549, TIMESTAMP WITH TIME ZONE '2018-10-31 08:03:32+00', 'Não parte o Gama enfim, que lho defende
');

	VALUES (562, 549, TIMESTAMP WITH TIME ZONE '2018-11-21 13:44:12+00', 'Que perpétua memória dele fique.
');
	VALUES (562, 652, TIMESTAMP WITH TIME ZONE '2018-11-21 18:52:54+00', 'Fortuna o trouxe a tão loiro desterro.
');

	VALUES (563, 667, TIMESTAMP WITH TIME ZONE '2020-05-10 10:04:00+00', '"Esta é por certo a terra que buscais
');
	VALUES (563, 667, TIMESTAMP WITH TIME ZONE '2020-05-10 17:06:38+00', 'De trombetas arcadas em redondo,
');

	VALUES (564, 551, TIMESTAMP WITH TIME ZONE '2019-06-07 20:23:27+00', 'Por sinais muito claros se mostrou,
');
	VALUES (564, 635, TIMESTAMP WITH TIME ZONE '2019-06-08 00:08:41+00', '--"Mas ó tu, geração daquele insano,
');
	VALUES (564, 635, TIMESTAMP WITH TIME ZONE '2019-06-08 07:52:44+00', 'Os belicosos ânimos, que inflama:
');
	VALUES (564, 635, TIMESTAMP WITH TIME ZONE '2019-06-08 11:22:31+00', 'Catilina, e vós outros dos antigos,
');

	VALUES (565, 552, TIMESTAMP WITH TIME ZONE '2018-10-06 05:51:35+00', 'Que promessas de reinos, e de minas
');
	VALUES (565, 606, TIMESTAMP WITH TIME ZONE '2018-10-06 12:12:37+00', 'Com todo o bom e honesto tratamento,
');
	VALUES (565, 606, TIMESTAMP WITH TIME ZONE '2018-10-06 12:32:17+00', 'Não só contra tal fúria se sustenta,
');
	VALUES (565, 606, TIMESTAMP WITH TIME ZONE '2018-10-06 15:05:09+00', 'O Catual que vira estar pintada,
');

	VALUES (566, 677, TIMESTAMP WITH TIME ZONE '2019-10-23 18:47:40+00', '"Com torva vista os vê, mas a natura
');
	VALUES (566, 677, TIMESTAMP WITH TIME ZONE '2019-10-24 01:28:50+00', 'E com Apio também Tarquilio o viu.
');

	VALUES (567, 553, TIMESTAMP WITH TIME ZONE '2020-06-10 20:38:15+00', 'Que com frondentes tirsos pelejava;
');
	VALUES (567, 667, TIMESTAMP WITH TIME ZONE '2020-06-10 22:58:23+00', 'De escultura formosa estão lavradas,
');
	VALUES (567, 553, TIMESTAMP WITH TIME ZONE '2020-06-11 00:14:09+00', 'Onde jazem os povos a quem nega
');
	VALUES (567, 553, TIMESTAMP WITH TIME ZONE '2020-06-11 01:57:50+00', 'Em quaisquer outras guerras que aconteças,
');

	VALUES (568, 553, TIMESTAMP WITH TIME ZONE '2019-11-16 08:00:02+00', 'Os ventos e despois os inimigos.
');
	VALUES (568, 553, TIMESTAMP WITH TIME ZONE '2019-11-16 09:49:20+00', 'Que vença o sogro a ti, e o genro a este.
');
	VALUES (568, 694, TIMESTAMP WITH TIME ZONE '2019-11-16 10:49:14+00', 'Será ali arrebatado e ao Céu subido.
');

	VALUES (569, 683, TIMESTAMP WITH TIME ZONE '2021-02-17 01:54:21+00', 'Só me falece ser a vós aceito,
');
	VALUES (569, 554, TIMESTAMP WITH TIME ZONE '2021-02-17 04:41:32+00', 'Dos trabalhos alheios feito rico.
');
	VALUES (569, 683, TIMESTAMP WITH TIME ZONE '2021-02-17 12:09:30+00', 'Que ninguém a seu Rei desobedeça;
');

	VALUES (570, 675, TIMESTAMP WITH TIME ZONE '2019-06-15 22:06:54+00', 'Vês outro, que do Tejo a terra pisa,
');
	VALUES (570, 555, TIMESTAMP WITH TIME ZONE '2019-06-15 22:44:37+00', 'Que degeneram, certo, e se desviam
');
	VALUES (570, 675, TIMESTAMP WITH TIME ZONE '2019-06-16 03:38:45+00', 'Lá na grande Inglaterra, que da neve
');

	VALUES (571, 556, TIMESTAMP WITH TIME ZONE '2021-02-07 20:56:31+00', 'Voa do Céu ao mar como uma seta.
');
	VALUES (571, 644, TIMESTAMP WITH TIME ZONE '2021-02-08 00:15:06+00', 'Para ver se conforme à sua seja,
');
	VALUES (571, 556, TIMESTAMP WITH TIME ZONE '2021-02-08 04:53:20+00', 'Que as fontes onde nascem tem por glória.
');
	VALUES (571, 644, TIMESTAMP WITH TIME ZONE '2021-02-08 10:19:03+00', 'Se não manda chegar a terra a armada;
');

	VALUES (572, 646, TIMESTAMP WITH TIME ZONE '2020-12-11 02:21:05+00', 'Vencidos vêm do sono, e mal despertos;
');
	VALUES (572, 559, TIMESTAMP WITH TIME ZONE '2020-12-11 04:54:11+00', 'Onde as forças magnânimas provara
');
	VALUES (572, 646, TIMESTAMP WITH TIME ZONE '2020-12-11 09:09:00+00', 'Me dobrarão a fúria concedida,
');
	VALUES (572, 559, TIMESTAMP WITH TIME ZONE '2020-12-11 10:02:38+00', 'Com um alto exórdio, de alta graça ornado,
');

	VALUES (573, 559, TIMESTAMP WITH TIME ZONE '2020-12-13 00:26:14+00', 'Onde seu gado os Azenegues pastam,
');
	VALUES (573, 638, TIMESTAMP WITH TIME ZONE '2020-12-13 05:07:42+00', 'Destruídos depois da Grega insânia.
');
	VALUES (573, 559, TIMESTAMP WITH TIME ZONE '2020-12-13 11:10:52+00', 'Sempre alcançou favor do Céu sereno.
');
	VALUES (573, 559, TIMESTAMP WITH TIME ZONE '2020-12-13 15:19:28+00', 'Que com título falso possuindo
');

