	VALUES (641, 658, TIMESTAMP WITH TIME ZONE '2020-05-28 18:26:37+00', 'Fogo de altos desejos, que a movera!
');
	VALUES (641, 621, TIMESTAMP WITH TIME ZONE '2020-05-29 02:07:23+00', 'Mui grande multidão da Assíria gente,
');

	VALUES (642, 621, TIMESTAMP WITH TIME ZONE '2020-01-25 11:44:45+00', 'Que ilustrada será co a Lei divina.
');

	VALUES (643, 677, TIMESTAMP WITH TIME ZONE '2021-04-26 13:32:01+00', 'Ali são seus trabalhos e fadigas,
');
	VALUES (643, 677, TIMESTAMP WITH TIME ZONE '2021-04-26 14:30:36+00', 'Já dão sinal, e o som da tuba impele
');
	VALUES (643, 623, TIMESTAMP WITH TIME ZONE '2021-04-26 19:07:55+00', 'E para o Norte o Emódio cavernoso.
');

	VALUES (644, 669, TIMESTAMP WITH TIME ZONE '2021-04-26 01:17:14+00', 'Do dia, em que por ele nos metemos.
');
	VALUES (644, 623, TIMESTAMP WITH TIME ZONE '2021-04-26 04:40:40+00', 'Das que pimenta ali têm produzido.
');
	VALUES (644, 669, TIMESTAMP WITH TIME ZONE '2021-04-26 07:30:47+00', '"Sinal é de inimigo e de ladrão,
');
	VALUES (644, 669, TIMESTAMP WITH TIME ZONE '2021-04-26 08:48:28+00', 'Que em lança de aço torna o Bago de ouro.
');

	VALUES (645, 625, TIMESTAMP WITH TIME ZONE '2019-12-21 09:58:01+00', 'Havendo-o por milagre, assim dizia:
');
	VALUES (645, 625, TIMESTAMP WITH TIME ZONE '2019-12-21 16:14:55+00', 'Secas do rosto as rosas, e perdida
');
	VALUES (645, 625, TIMESTAMP WITH TIME ZONE '2019-12-21 18:09:44+00', 'Com esta, as tristes almas revocava
');
	VALUES (645, 625, TIMESTAMP WITH TIME ZONE '2019-12-21 18:58:48+00', 'Ter o Tígris e Eufrates üa entrada.
');

	VALUES (646, 650, TIMESTAMP WITH TIME ZONE '2020-04-03 06:30:38+00', 'Rei de Cambaia e a vista lhe amedrenta
');
	VALUES (646, 650, TIMESTAMP WITH TIME ZONE '2020-04-03 12:04:59+00', 'E não acha que é justo e bom respeito,
');
	VALUES (646, 626, TIMESTAMP WITH TIME ZONE '2020-04-03 17:52:01+00', 'Vereis ao Rei potente sojugados;
');
	VALUES (646, 650, TIMESTAMP WITH TIME ZONE '2020-04-03 22:45:09+00', 'Se alguma traz idónea lá da banda
');

	VALUES (647, 626, TIMESTAMP WITH TIME ZONE '2020-05-14 14:28:46+00', 'O grande Arquiteto co''o filho, dando
');
	VALUES (647, 694, TIMESTAMP WITH TIME ZONE '2020-05-14 16:12:04+00', 'Dão louvores e graças sem medida:
');
	VALUES (647, 626, TIMESTAMP WITH TIME ZONE '2020-05-14 19:26:09+00', 'O monte Abila e o nobre fundamento
');

	VALUES (648, 627, TIMESTAMP WITH TIME ZONE '2019-12-05 17:06:38+00', 'Pelas roxas Arábicas ribeiras:
');
	VALUES (648, 627, TIMESTAMP WITH TIME ZONE '2019-12-06 00:37:03+00', 'Para que com sublime coração
');

	VALUES (649, 628, TIMESTAMP WITH TIME ZONE '2021-01-11 00:22:22+00', 'De Mauritânia os montes e lugares,
');

	VALUES (650, 630, TIMESTAMP WITH TIME ZONE '2018-12-04 15:07:46+00', 'Mas só por ver das gentes as sentenças:
');
	VALUES (650, 630, TIMESTAMP WITH TIME ZONE '2018-12-04 16:33:00+00', 'Porque a conquista dela lhe tomara,
');
	VALUES (650, 669, TIMESTAMP WITH TIME ZONE '2018-12-04 17:19:25+00', 'O corpo nu, e os membros genitais,
');
	VALUES (650, 669, TIMESTAMP WITH TIME ZONE '2018-12-04 18:14:10+00', 'Subitamente os outros amadores;
');

	VALUES (651, 630, TIMESTAMP WITH TIME ZONE '2018-10-16 22:38:45+00', 'Trabalhos e perigos inumanos,
');
	VALUES (651, 670, TIMESTAMP WITH TIME ZONE '2018-10-17 02:26:17+00', 'Os ventos e despois os inimigos.
');
	VALUES (651, 670, TIMESTAMP WITH TIME ZONE '2018-10-17 04:39:51+00', '(Sem lhe valerem ordens) de alta torre,
');

	VALUES (652, 631, TIMESTAMP WITH TIME ZONE '2020-11-22 11:52:47+00', 'Algumas, que na forma descoberta
');
	VALUES (652, 654, TIMESTAMP WITH TIME ZONE '2020-11-22 19:50:38+00', 'O Regedor das ilhas, que partia.
');
	VALUES (652, 631, TIMESTAMP WITH TIME ZONE '2020-11-22 20:19:41+00', 'Pois inda neste Reino e neste Rei
');

	VALUES (653, 670, TIMESTAMP WITH TIME ZONE '2018-10-14 10:05:31+00', 'Que primeiro contra ele pelejava.
');
	VALUES (653, 632, TIMESTAMP WITH TIME ZONE '2018-10-14 15:43:06+00', 'Alimpamos as naus, que dos caminhos
');

	VALUES (654, 673, TIMESTAMP WITH TIME ZONE '2020-11-24 21:22:23+00', 'Um desejo imortal lhe acende e atiça:
');
	VALUES (654, 632, TIMESTAMP WITH TIME ZONE '2020-11-25 02:06:32+00', 'Salta, corre, sibila, acena, e brada,
');
	VALUES (654, 673, TIMESTAMP WITH TIME ZONE '2020-11-25 03:14:25+00', 'Antes que soe o estouro, mal sofrido
');

	VALUES (655, 633, TIMESTAMP WITH TIME ZONE '2021-01-06 11:23:00+00', 'As partes tão remotas onde estamos,
');
	VALUES (655, 633, TIMESTAMP WITH TIME ZONE '2021-01-06 18:08:45+00', 'Outrem, por quem meu nome se escureça?
');
	VALUES (655, 673, TIMESTAMP WITH TIME ZONE '2021-01-06 21:56:47+00', 'Para o Gama vem com passo brando,
');
	VALUES (655, 673, TIMESTAMP WITH TIME ZONE '2021-01-06 23:52:56+00', 'Fora na região da Berberia,
');

	VALUES (656, 662, TIMESTAMP WITH TIME ZONE '2020-02-21 08:59:27+00', 'Na capitaina imiga, dentro nela
');

	VALUES (657, 676, TIMESTAMP WITH TIME ZONE '2019-08-18 09:09:12+00', 'Nos paços de Netuno, que avisado
');
	VALUES (657, 676, TIMESTAMP WITH TIME ZONE '2019-08-18 13:33:28+00', 'Nem tanto o grã Tonante arremessou
');

	VALUES (658, 691, TIMESTAMP WITH TIME ZONE '2020-08-24 11:23:30+00', 'O claro descendente de Abraão
');

	VALUES (659, 677, TIMESTAMP WITH TIME ZONE '2019-10-26 13:23:17+00', 'Depois que o Rei Fernando faleceu.
');
	VALUES (659, 635, TIMESTAMP WITH TIME ZONE '2019-10-26 17:51:06+00', 'Se as armas queres ver, como tens dito,
');
	VALUES (659, 635, TIMESTAMP WITH TIME ZONE '2019-10-27 00:09:53+00', 'Mas destes acha poucos a pintura."
');

	VALUES (660, 656, TIMESTAMP WITH TIME ZONE '2021-02-07 16:36:14+00', 'E não se acabará só nisto o dano
');

	VALUES (661, 669, TIMESTAMP WITH TIME ZONE '2021-02-08 02:44:48+00', 'Vai ferir noutra parte luminoso,
');

	VALUES (662, 637, TIMESTAMP WITH TIME ZONE '2020-06-03 13:38:10+00', 'Do belo corpo estavam confiadas,
');
	VALUES (662, 679, TIMESTAMP WITH TIME ZONE '2020-06-03 15:19:26+00', 'Neste peito mortal, que tanto te ama.
');
	VALUES (662, 679, TIMESTAMP WITH TIME ZONE '2020-06-03 16:45:43+00', 'Que, a troco do metal luzente e louro,
');
	VALUES (662, 637, TIMESTAMP WITH TIME ZONE '2020-06-03 20:08:10+00', 'O porá onde esforço nem prudência
');

	VALUES (663, 640, TIMESTAMP WITH TIME ZONE '2020-10-07 03:48:23+00', 'Foi dele alegremente agasalhado;
');

	VALUES (664, 641, TIMESTAMP WITH TIME ZONE '2018-08-03 20:39:33+00', 'Acude e corre, pai, que se não corres,
');

	VALUES (665, 642, TIMESTAMP WITH TIME ZONE '2019-11-13 00:23:45+00', 'Sofrendo morte injusta e insofríbil,
');

	VALUES (666, 684, TIMESTAMP WITH TIME ZONE '2021-04-27 11:32:58+00', 'Esta empresa tão árdua, que o moveu
');
	VALUES (666, 684, TIMESTAMP WITH TIME ZONE '2021-04-27 18:16:45+00', 'D''além do claro Tejo deleitoso;
');
	VALUES (666, 642, TIMESTAMP WITH TIME ZONE '2021-04-27 21:33:14+00', 'Lhe manda rogar muito que saíssem,
');

	VALUES (667, 643, TIMESTAMP WITH TIME ZONE '2020-11-16 22:55:14+00', 'Para Eneias, seu filho, navegando;
');
	VALUES (667, 656, TIMESTAMP WITH TIME ZONE '2020-11-17 04:35:58+00', 'Já blasfema da guerra, e maldizia,
');

	VALUES (668, 682, TIMESTAMP WITH TIME ZONE '2021-02-15 20:31:09+00', 'Cessem do sábio Grego e do Troiano
');
	VALUES (668, 682, TIMESTAMP WITH TIME ZONE '2021-02-15 23:59:47+00', 'Dele em Germânia, com que a morte engane;
');
	VALUES (668, 682, TIMESTAMP WITH TIME ZONE '2021-02-16 00:44:50+00', 'Contra poder tamanho, e que viesse,
');

	VALUES (669, 679, TIMESTAMP WITH TIME ZONE '2021-01-21 03:59:29+00', 'Do mundo onde morais distintamente;
');

	VALUES (670, 645, TIMESTAMP WITH TIME ZONE '2021-02-02 17:45:46+00', 'Onde toda a província do mar grande
');

	VALUES (671, 687, TIMESTAMP WITH TIME ZONE '2021-01-26 10:42:56+00', 'A grande multidão que irá matando
');

	VALUES (672, 663, TIMESTAMP WITH TIME ZONE '2020-03-29 07:07:07+00', 'Nas Anfióneas Tebas se causaram;
');
	VALUES (672, 646, TIMESTAMP WITH TIME ZONE '2020-03-29 11:01:24+00', 'Ser mais retido, sendo às naus chegado
');
	VALUES (672, 663, TIMESTAMP WITH TIME ZONE '2020-03-29 13:18:55+00', 'Cercar vai Badajoz, e logo alcança
');
	VALUES (672, 646, TIMESTAMP WITH TIME ZONE '2020-03-29 14:58:27+00', 'Mas agora de nomes e de usança
');

	VALUES (673, 668, TIMESTAMP WITH TIME ZONE '2018-11-20 20:20:28+00', 'Por lhe pôr em sossego o peito irado,
');

	VALUES (674, 647, TIMESTAMP WITH TIME ZONE '2020-10-18 18:51:20+00', 'Isto dito, velozes mais que gamos,
');
	VALUES (674, 647, TIMESTAMP WITH TIME ZONE '2020-10-19 02:48:28+00', 'Com que também do campo a cor se perde,
');
	VALUES (674, 667, TIMESTAMP WITH TIME ZONE '2020-10-19 07:37:54+00', 'Do Mouro ali verão que a voz extrema
');

	VALUES (675, 682, TIMESTAMP WITH TIME ZONE '2019-12-02 18:11:48+00', 'O Bárbaro comete apercebido,
');
	VALUES (675, 648, TIMESTAMP WITH TIME ZONE '2019-12-02 22:30:44+00', 'Com palavras soberbas o arrogante
');

	VALUES (676, 648, TIMESTAMP WITH TIME ZONE '2019-10-27 20:27:30+00', 'Animais que eles têm em mais estima
');

	VALUES (677, 653, TIMESTAMP WITH TIME ZONE '2020-12-02 05:32:15+00', 'Quando, com muito poucos Portugueses,
');
	VALUES (677, 653, TIMESTAMP WITH TIME ZONE '2020-12-02 05:40:50+00', 'A todo o Malabar terá admirado.
');

	VALUES (678, 653, TIMESTAMP WITH TIME ZONE '2020-11-23 10:24:55+00', 'Nenhum sinal aqui da Índia achamos
');
	VALUES (678, 653, TIMESTAMP WITH TIME ZONE '2020-11-23 18:18:17+00', 'E de sincero amor sejam dotados!
');
	VALUES (678, 653, TIMESTAMP WITH TIME ZONE '2020-11-24 01:24:09+00', 'Está o famoso nome Sarraceno.
');

	VALUES (679, 683, TIMESTAMP WITH TIME ZONE '2020-10-30 14:17:02+00', 'Co''o riso uma tristeza misturada,
');
	VALUES (679, 683, TIMESTAMP WITH TIME ZONE '2020-10-30 21:38:07+00', 'Que da paternal coxa foi nascido,
');
	VALUES (679, 683, TIMESTAMP WITH TIME ZONE '2020-10-31 02:39:27+00', 'Tem me falta na vida honesto estudo,
');

	VALUES (680, 684, TIMESTAMP WITH TIME ZONE '2021-04-19 00:47:47+00', 'Rendendo-se à vontade do inimigo,
');
	VALUES (680, 654, TIMESTAMP WITH TIME ZONE '2021-04-19 07:21:31+00', '"Desta arte Afonso súbito mostrado
');
	VALUES (680, 684, TIMESTAMP WITH TIME ZONE '2021-04-19 14:45:10+00', 'As naus se vá, e, seguro de algum dano,
');

	VALUES (681, 676, TIMESTAMP WITH TIME ZONE '2020-10-14 15:02:50+00', 'Já não fica na aljava seta alguma,
');
	VALUES (681, 655, TIMESTAMP WITH TIME ZONE '2020-10-14 15:54:05+00', 'Vinham a ele e à morte oferecer-se.
');
	VALUES (681, 655, TIMESTAMP WITH TIME ZONE '2020-10-14 16:54:34+00', 'É desses gastadores, que sabemos,
');

	VALUES (682, 656, TIMESTAMP WITH TIME ZONE '2020-11-11 12:20:27+00', 'Das mãos dos Mouros entra a feliz alma,
');
	VALUES (682, 696, TIMESTAMP WITH TIME ZONE '2020-11-11 16:54:52+00', 'Estes, o Rei que têm, não foi nacido
');
	VALUES (682, 696, TIMESTAMP WITH TIME ZONE '2020-11-11 22:57:30+00', 'Ó caso nunca visto e milagroso,
');
	VALUES (682, 696, TIMESTAMP WITH TIME ZONE '2020-11-12 01:15:01+00', 'Buscando algum remédio a meus pesares,
');

	VALUES (683, 670, TIMESTAMP WITH TIME ZONE '2019-05-06 12:28:24+00', 'Doenças, frechas e trovões ardentes,
');
	VALUES (683, 670, TIMESTAMP WITH TIME ZONE '2019-05-06 20:23:41+00', 'Torna para detrás a nau forçada,
');

	VALUES (684, 666, TIMESTAMP WITH TIME ZONE '2019-04-30 09:27:56+00', 'E por mais segurar-se os Deuses vãos,
');

	VALUES (685, 661, TIMESTAMP WITH TIME ZONE '2019-04-24 02:30:49+00', 'No Céu sereno, abrindo a roxa entrada
');

	VALUES (686, 672, TIMESTAMP WITH TIME ZONE '2020-04-03 19:57:11+00', 'Vês o céu de Saturno, Deus antigo;
');
	VALUES (686, 662, TIMESTAMP WITH TIME ZONE '2020-04-03 21:26:09+00', 'De quem quer que por ele corra e ande:
');
	VALUES (686, 672, TIMESTAMP WITH TIME ZONE '2020-04-03 22:51:18+00', 'Senão da Portuguesa tão somente.
');
	VALUES (686, 672, TIMESTAMP WITH TIME ZONE '2020-04-04 03:23:25+00', 'Esta, meia escondida, que responde
');

	VALUES (687, 694, TIMESTAMP WITH TIME ZONE '2020-04-17 16:02:34+00', 'Do Capitão devoto, que, apartado
');

	VALUES (688, 685, TIMESTAMP WITH TIME ZONE '2019-09-30 21:32:56+00', 'Que o trabalho por vir me está dizendo."
');
	VALUES (688, 685, TIMESTAMP WITH TIME ZONE '2019-09-30 22:10:19+00', 'Que o coração para ele é vaso estreito.
');
	VALUES (688, 664, TIMESTAMP WITH TIME ZONE '2019-10-01 01:14:46+00', 'Agora com os conselhos bem cuidados,
');

	VALUES (689, 665, TIMESTAMP WITH TIME ZONE '2020-03-17 19:48:51+00', 'Que com grita grandíssima os recebem,
');
	VALUES (689, 665, TIMESTAMP WITH TIME ZONE '2020-03-17 23:37:28+00', 'Tudo corria e via, e a todos dava,
');

	VALUES (690, 665, TIMESTAMP WITH TIME ZONE '2020-05-09 10:11:49+00', 'O peito de desejos e esperanças.
');
	VALUES (690, 666, TIMESTAMP WITH TIME ZONE '2020-05-09 16:02:57+00', 'Estrangeiros na terra, Lei e nação;
');
	VALUES (690, 665, TIMESTAMP WITH TIME ZONE '2020-05-09 17:59:56+00', 'Vide, com uns cachos roxos e outros verdes;
');
	VALUES (690, 665, TIMESTAMP WITH TIME ZONE '2020-05-09 19:54:25+00', 'Tomando-o pela mão, o leva e guia
');

	VALUES (691, 666, TIMESTAMP WITH TIME ZONE '2019-12-09 04:56:46+00', 'Mil árvores silvestres e ervas várias
');
	VALUES (691, 666, TIMESTAMP WITH TIME ZONE '2019-12-09 07:14:49+00', 'Daqui, tanto que Bóreas nos ventou,
');
	VALUES (691, 682, TIMESTAMP WITH TIME ZONE '2019-12-09 13:09:44+00', 'Que te custava ter-me neste engano,
');
	VALUES (691, 682, TIMESTAMP WITH TIME ZONE '2019-12-09 20:44:14+00', 'Com que seja de todo destruído.
');

	VALUES (692, 666, TIMESTAMP WITH TIME ZONE '2019-11-13 14:32:51+00', 'Os semeados campos alagaram
');
	VALUES (692, 677, TIMESTAMP WITH TIME ZONE '2019-11-13 15:59:20+00', 'Lhe diz como eram gentes roubadoras,
');

	VALUES (693, 671, TIMESTAMP WITH TIME ZONE '2021-01-16 09:13:52+00', 'E pagaram seus anos deste jeito
');

	VALUES (694, 686, TIMESTAMP WITH TIME ZONE '2020-05-13 09:54:49+00', 'Mas o animal atroce, nesse instante,
');
	VALUES (694, 667, TIMESTAMP WITH TIME ZONE '2020-05-13 11:52:53+00', 'Tudo render-se ser depois rendido.
');

	VALUES (695, 695, TIMESTAMP WITH TIME ZONE '2019-02-24 22:54:30+00', 'Que alegria não pode ser tamanha,
');
	VALUES (695, 668, TIMESTAMP WITH TIME ZONE '2019-02-24 23:42:47+00', 'Mas um só, que Magriço se dizia,
');
	VALUES (695, 668, TIMESTAMP WITH TIME ZONE '2019-02-25 04:08:01+00', 'Quanto a desesperar já compelidos,
');

	VALUES (696, 669, TIMESTAMP WITH TIME ZONE '2019-12-13 05:51:32+00', '"Olha cá dois infantes, Pedro e Henrique,
');
	VALUES (696, 669, TIMESTAMP WITH TIME ZONE '2019-12-13 08:09:39+00', 'As ondas de Netuno furibundo;
');
	VALUES (696, 669, TIMESTAMP WITH TIME ZONE '2019-12-13 10:04:36+00', 'A terra Eoa o Rei dos Lusitanos.
');

	VALUES (697, 696, TIMESTAMP WITH TIME ZONE '2018-09-30 21:52:10+00', 'Não perderá seu preço, e sua valia.
');
	VALUES (697, 670, TIMESTAMP WITH TIME ZONE '2018-10-01 03:00:21+00', 'Que nomes tão diversos vai tomando,
');
	VALUES (697, 670, TIMESTAMP WITH TIME ZONE '2018-10-01 05:46:58+00', 'Começa a alvoroçar-se geralmente.
');
	VALUES (697, 696, TIMESTAMP WITH TIME ZONE '2018-10-01 12:56:51+00', 'Da vitória que logo lhe daria.
');

	VALUES (698, 672, TIMESTAMP WITH TIME ZONE '2021-02-02 22:34:35+00', 'Melodia sonora e concertada,
');
	VALUES (698, 672, TIMESTAMP WITH TIME ZONE '2021-02-02 23:28:10+00', 'Diz-lhe que vêm de gente carregadas,
');

	VALUES (699, 671, TIMESTAMP WITH TIME ZONE '2020-12-30 09:08:07+00', '"Podem-se pôr em longo esquecimento
');

	VALUES (700, 673, TIMESTAMP WITH TIME ZONE '2020-11-22 20:18:48+00', 'Se chega um Mahometa, que nascido
');
	VALUES (700, 696, TIMESTAMP WITH TIME ZONE '2020-11-23 01:29:48+00', 'Nace por este incógnito Hemispério
');
	VALUES (700, 696, TIMESTAMP WITH TIME ZONE '2020-11-23 04:56:37+00', 'Haverá que resista, se Lisboa
');
	VALUES (700, 696, TIMESTAMP WITH TIME ZONE '2020-11-23 08:38:14+00', 'Que quem há, que por fama não conhece
');

	VALUES (701, 678, TIMESTAMP WITH TIME ZONE '2020-12-17 03:55:41+00', 'Nos seus batéis, da frota se partia
');
	VALUES (701, 678, TIMESTAMP WITH TIME ZONE '2020-12-17 05:26:17+00', 'E o bravo morador destrue e doma.
');

	VALUES (702, 674, TIMESTAMP WITH TIME ZONE '2020-07-21 10:45:00+00', 'Que a marítima gente tem por santo
');
	VALUES (702, 691, TIMESTAMP WITH TIME ZONE '2020-07-21 14:05:11+00', 'De Portugal fazendo-se inimigo?
');

	VALUES (703, 676, TIMESTAMP WITH TIME ZONE '2020-05-27 04:36:34+00', 'Porque das Parcas sei, minhas amigas,
');
	VALUES (703, 679, TIMESTAMP WITH TIME ZONE '2020-05-27 09:02:31+00', 'De Giraldo, que medos não temia.
');

	VALUES (704, 686, TIMESTAMP WITH TIME ZONE '2019-07-28 12:59:45+00', '"Também Sequeira, as ondas Eritreias
');
	VALUES (704, 686, TIMESTAMP WITH TIME ZONE '2019-07-28 16:44:58+00', '"Mas moura enfim nas mãos das brutas gentes,
');
	VALUES (704, 686, TIMESTAMP WITH TIME ZONE '2019-07-28 22:27:33+00', 'Aonde as naus estavam temerosas,
');
	VALUES (704, 676, TIMESTAMP WITH TIME ZONE '2019-07-28 23:10:34+00', 'Já lhe obedece a terra num momento,
');

	VALUES (705, 677, TIMESTAMP WITH TIME ZONE '2019-11-16 10:42:00+00', 'Isto dizendo, acorda o Mouro asinha,
');
	VALUES (705, 677, TIMESTAMP WITH TIME ZONE '2019-11-16 15:08:56+00', 'Ela, solta, voou da prisão fora
');

	VALUES (706, 678, TIMESTAMP WITH TIME ZONE '2019-01-28 16:08:25+00', 'Não acha quem por armas lhe resista;
');

	VALUES (707, 679, TIMESTAMP WITH TIME ZONE '2020-05-18 08:01:51+00', 'Para uma empresa, qual a vós se deve,
');
	VALUES (707, 679, TIMESTAMP WITH TIME ZONE '2020-05-18 12:12:08+00', 'Onde vestindo a forma e gesto humano,
');

	VALUES (708, 689, TIMESTAMP WITH TIME ZONE '2020-11-29 22:01:47+00', 'Pela praia brincando vem diante
');
	VALUES (708, 680, TIMESTAMP WITH TIME ZONE '2020-11-30 04:39:44+00', 'Uma gente fortíssima de Espanha
');
	VALUES (708, 680, TIMESTAMP WITH TIME ZONE '2020-11-30 12:38:49+00', 'Quereis que com as velas leve o vento?"--
');
	VALUES (708, 689, TIMESTAMP WITH TIME ZONE '2020-11-30 14:45:56+00', 'Para as terras se passa Transtaganas.
');

	VALUES (709, 680, TIMESTAMP WITH TIME ZONE '2021-02-25 06:14:21+00', 'Demos lugar ao nome Lusitano?
');
	VALUES (709, 680, TIMESTAMP WITH TIME ZONE '2021-02-25 12:53:21+00', '"Do mar temos corrido e navegado
');
	VALUES (709, 681, TIMESTAMP WITH TIME ZONE '2021-02-25 17:27:40+00', 'Sentado o Gama junto ao rico leito,
');

	VALUES (710, 695, TIMESTAMP WITH TIME ZONE '2019-12-04 11:50:18+00', 'Que todo Portugal aos Mouros toma;
');

	VALUES (711, 696, TIMESTAMP WITH TIME ZONE '2019-11-13 08:39:59+00', 'Que um fraco Rei f az fraca a forte gente.
');

